INSERT INTO onlinemoviedatabase.video (dtype, id, added_by, backdrop_path, created_date, homepage, imdb_page, original_language, original_title, overview, poster_path, title, trailer_link, updated_date, date_of_release, released, runtime, tmdb_movie_id, final_air_date, number_of_seasons, pilot_air_date, tmdb_tv_show_id) VALUES('TvShow', 15, 'madjarica', '/30iomnEyQWtJ9aT2vsbzWUgjrzV.jpg', NULL, 'http://www.channel4.com/programmes/black-books/', 'http://www.imdb.com/title/tt0262150', 'English', 'Black Books', 'Black Books centres around the foul tempered and wildly eccentric bookshop owner Bernard Black. Bernardâ€™s devotion to the twin pleasures of drunkenness and wilful antagonism deepens and enriches both his life and that of Manny, his assistant. Bearded, sweet and good, Manny is everything that Bernard isnâ€™t and is punished by Bernard relentlessly just for the crime of existing. They depend on each other for meaning as Fran, their oldest friend, depends on them for distraction. Black Books is a haven of books, wine and conversation, the only threat to the groupâ€™s peace and prosperity is their own limitless stupidity.', '/tsUt2zYItvEtuFaRzOGJngCdO36.jpg', 'Black Books', NULL, NULL, NULL, NULL, NULL, NULL, '2004-04-15 02:00:00.000', 3, '2000-09-29 02:00:00.000', 903);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(1, 'Audrey Justine Tautou (French pronunciation: [o.dÊ�É› to.tu]; born 9 August 1976) is a French actress and model. Signed by an agent at age 17, she made her acting debut at 18 on television and her feature film debut the following year in Venus Beauty Institute (1999), for which she received critical acclaim and won the CÃ©sar Award for Most Promising Actress. Her subsequent roles in the 1990s and 2000s included Le Libertin and Happenstance (2000). Tautou achieved international recognition for her lead role in the 2001 film AmÃ©lie, which met with critical acclaim and was a major box-office success. AmÃ©lie won Best Film at the European Film Awards, four CÃ©sar Awards (including Best Film and Best Director), two BAFTA Awards (including Best Original Screenplay), and was nominated for five Academy Awards.  Tautou has since appeared in films in a range of genres, including the thrillers Dirty Pretty Things and The Da Vinci Code, and the romantic Priceless (2006). She has received critical acclaim for her many roles including the drama A Very Long Engagement (2004) and the biographical drama Coco avant Chanel (2009). She has been nominated three times for the CÃ©sar Award and twice for the BAFTA for Best Actress in a leading role. She became one of the few French actors in history to be invited to join the Academy of Motion Picture Arts and Sciences (AMPAS) in June 2004. Tautou has modeled for Chanel, Montblanc, L''OrÃ©al and many other companies. She is an active supporter of several charities.', '1976-08-09 01:00:00.000', NULL, 'Audrey Tautou', '/zVBnztf1vAJg6COSEyrQaUUr2PS.jpg', 'Beaumont, Puy-de-DÃ´me, France', NULL, 2405, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(2, 'From Wikipedia, the free encyclopedia. Mathieu Kassovitz (born 3 August 1967) is a French director, screenwriter, producer and actor, best known for his Cannes-winning drama La Haine. Kassovitz is also the founder of MNP Entreprise, a film production company. Description above from the Wikipedia article Mathieu Kassovitz, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1967-08-03 01:00:00.000', NULL, 'Mathieu Kassovitz', '/6QeXmtq08zzVN0Ix6SHWpVoV8vn.jpg', 'Paris, France', NULL, 2406, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(3, 'Rufus (born 19 December 1942; Riom, Puy-de-DÃ´me) is the stage name of French actor Jacques Narcy. He is best known by the international film audience for his performance as RaphaÃ«l, the father of AmÃ©lie Poulain in AmÃ©lie (2001). He has appeared in numerous French TV series and productions, including most of the films directed by Jean-Pierre Jeunet. He had the lead role in the movie Train de vie (1998), an award-winning tragicomedy about the Holocaust. Description above from the Wikipedia article Rufus (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1942-12-19 01:00:00.000', NULL, 'Rufus', '/bbMPwEFZaALc3VqBPZ8od2rmRuv.jpg', 'Riom, Puy-de-DÃ´me, France', NULL, 2407, NULL);
