INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(7, 'After studying at the Faculty of Arts of Poitiers, Dominique Pinon moved to Paris where he enrolled at the Cours Simon acting school. His introducing appearance in cinema took place in 1981 in the movie Diva by Jean-Jacques Beineix. Pinon is considered to be a theatre actor in first place, with constant on-stage acting since 1985. Until today, he has appeared in the plays of Gildas Bourdet, Jorge Lavelli, ValÃ¨re Novarina and numerous others. His career in cinema, counting more than 80 movies to-date, shows a strong collaboration with director Jean-Pierre Jeunet. Amongst these 8 movies dating from between 1990 and 2013, it is most notably his appearances in Delicatessen (1991), Alien Resurrection (1997) and AmÃ©lie (2001) which made him become known to the broader public outside of France. Pinon also had numerous appearences on French TV, both in movies as well as in series. His most recent international appearance on TV is that of the character Master Raymond in the second season of the award-winning TV series Outlander. He received the MoliÃ¨re theatre award for Best Actor in 2004 and was awarded the title of Officier de l''Ordre des Arts et des Lettres in 2014.', '1955-03-04 01:00:00.000', NULL, 'Dominique Pinon', '/wPemV26c0rBrJ4nQIFXfsRuLh5q.jpg', 'Saumur, Maine-et-Loire, France', NULL, 2413, NULL);
