INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(15, 'From Wikipedia, the free encyclopedia Jean-Pierre Jeunet is a French film director and screenwriter known for the films Delicatessen, The City of Lost Children, Alien: Resurrection and AmÃ©lie. Jean-Pierre Jeunet was born in Roanne, Loire, France. He bought his first camera at the age of 17 and made short films while studying animation at CinÃ©mation Studios. He befriended Marc Caro, a designer and comic book artist who became his longtime collaborator and co-director. They met at an animation festival in Annecy in 1974. Together, Jeunet and Caro directed award-winning animations. Their first live action film was The Bunker of the Last Gunshots (1981), a short film about soldiers in a bleak futuristic world. Jeunet also directed numerous advertisements and music videos, such as Jean Michel Jarre''s Zoolook (together with Caro). Jeunet''s films often resonate with the late twentieth century French film movement, cinÃ©ma du look, and allude to themes and aesthetics involving German expressionism, French poetic realism, and the French New Wave. Jeunet and Caro''s first feature film was Delicatessen (1991), a melancholy comedy set in a famine-plagued post-apocalyptic world, in which an apartment building above a delicatessen is ruled by a butcher who kills people in order to feed his tenants. They next made The City of Lost Children (1995), a dark, multi-layered fantasy film about a mad scientist who steals children''s dreams so that he can live indefinitely.[3] The success of The City of Lost Children led to an invitation to direct the fourth film in the Alien series, Alien: Resurrection (1997). This is where Jeunet and Caro ended up going their separate ways as Jeunet believed this to be an amazing opportunity and Caro was not interested in a film that lacked creative control working on a big-budget Hollywood movie. Caro ended up assisting for a few weeks, with costumes and set design but afterwards, decided to work on a solo career in illustration and computer graphics. Jeunet directed AmÃ©lie (2001), starring Audrey Tautou. AmÃ©lie is the story of a woman who takes pleasure in doing good deeds but has trouble finding love herself, was a huge critical and commercial success worldwide and was nominated for several Academy Awards. For this film, Jeunet also gained a European Film Award for Best Director. Jeunet has also directed numerous commercials including a 2''25" film for Chanel NÂ° 5 featuring his frequent collaborator Audrey Tautou. Description above from the Wikipedia article Jean-Pierre Jeunet, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1953-09-03 01:00:00.000', NULL, 'Jean-Pierre Jeunet', '/504QzXvAttagp7SvTyzuFXmzt1v.jpg', 'Roanne, Loire, France', NULL, 2419, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(16, 'Edward Harrison Norton (born August 18, 1969) is an American actor, screenwriter, film director and producer. In 1996, his supporting role in the courtroom drama Primal Fear garnered him a nomination for the Academy Award for Best Supporting Actor. Two years later, his lead role as a reformed white power skinhead in American History X earned a nomination for Academy Award for Best Actor. His other films include period dramas such as Kingdom of Heaven (2005), The Illusionist (2006), and The Painted Veil (2006); and other notable films such as Rounders (1998), Fight Club (1999), 25th Hour (2002), Red Dragon (2002), and The Incredible Hulk (2008). In addition to acting, Norton is also a writer and director. He made his directorial debut with the film Keeping the Faith (2000) and is slated to direct the film adaptation of the novel Motherless Brooklyn. Norton did uncredited work on the scripts for The Score, Frida, and The Incredible Hulk. In his private life, Norton is an environmental and social activist. He is a member of the board of trustees of Enterprise Community Partners, a non-profit organization for developing affordable housing, founded by his grandfather, James Rouse. Norton is president of the American branch of the Maasai Wilderness Conservation Trust. He ran in the 2009 New York City Marathon to raise money for the Trust. He also raises money for charity through Crowdrise, a social networking community for volunteers and a micro-donations fundraising platform. In July 2010, Norton was designated as the United Nations Goodwill Ambassador for Biodiversityby UN Secretary-General Ban Ki-moon.', '1969-08-18 01:00:00.000', NULL, 'Edward Norton', '/588Hrov6wwM9WcU88nJHlw2iufN.jpg', 'Boston, Massachusetts, USA', NULL, 819, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(17, 'William Bradley "Brad" Pitt (born December 18, 1963) is an American actor and film producer. Pitt has received two Academy Award nominations and four Golden Globe Award nominations, winning one. He has been described as one of the world''s most attractive men, a label for which he has received substantial media attention. Pitt began his acting career with television guest appearances, including a role on the CBS prime-time soap opera Dallas in 1987. He later gained recognition as the cowboy hitchhiker who seduces Geena Davis''s character in the 1991 road movie Thelma & Louise. Pitt''s first leading roles in big-budget productions came with A River Runs Through It (1992) and Interview with the Vampire (1994). He was cast opposite Anthony Hopkins in the 1994 drama Legends of the Fall, which earned him his first Golden Globe nomination. In 1995 he gave critically acclaimed performances in the crime thriller Seven and the science fiction film 12 Monkeys, the latter securing him a Golden Globe Award for Best Supporting Actor and an Academy Award nomination. Four years later, in 1999, Pitt starred in the cult hit Fight Club. He then starred in the major international hit as Rusty Ryan in Ocean''s Eleven (2001) and its sequels, Ocean''s Twelve (2004) and Ocean''s Thirteen (2007). His greatest commercial successes have been Troy (2004) and Mr. & Mrs. Smith (2005). Pitt received his second Academy Award nomination for his title role performance in the 2008 film The Curious Case of Benjamin Button. Following a high-profile relationship with actress Gwyneth Paltrow, Pitt was married to actress Jennifer Aniston for five years. Pitt lives with actress Angelina Jolie in a relationship that has generated wide publicity. He and Jolie have six childrenâ€”Maddox, Pax, Zahara, Shiloh, Knox, and Vivienne. Since beginning his relationship with Jolie, he has become increasingly involved in social issues both in the United States and internationally. Pitt owns a production company named Plan B Entertainment, whose productions include the 2007 Academy Award winning Best Picture, The Departed.', '1963-12-18 01:00:00.000', NULL, 'Brad Pitt', '/Byn7JN0BW16DWrVbpdaiXf3cso.jpg', 'Shawnee, Oklahoma, USA', NULL, 287, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(18, 'Michael Lee Aday (born Marvin Lee Aday; September 27, 1947), better known by his stage name, Meat Loaf, is an American rock musician and actor. He is noted for the Bat Out of Hell album trilogy consisting of Bat Out of Hell, Bat Out of Hell II: Back Into Hell and Bat Out of Hell III: The Monster Is Loose. Bat Out of Hell has sold more than 43 million copies. After more than 30 years, it still sells an estimated 200,000 copies annually, and stayed on the charts for over nine years, making it one of the best selling albums of all time. Although he enjoyed success with Bat Out of Hell and Bat Out of Hell II: Back into Hell, and earned a Grammy Award for Best Rock Vocal Performance, Solo for a track on the latter album, Meat Loaf experienced some initial difficulty establishing a steady career within his native US. However, he has retained iconic status and popularity in Europe, especially the UK, where he ranks 23rd for number of weeks overall spent on the charts. He ranked 96th on VH1''s "100 Greatest Artists of Hard Rock." Meat Loaf has also appeared in over 50 movies or television shows, sometimes as himself, or as characters resembling his stage persona. His most notable roles include Eddie in the American premiere of The Rocky Horror Show and in The Rocky Horror Picture Show, and Robert "Bob" Paulson in Fight Club. Description above from the Wikipedia article Meat Loaf, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1947-09-27 02:00:00.000', NULL, 'Meat Loaf', '/kdcffJAYeXmzkjOcqISXFe1vHBI.jpg', 'Dallas, Texas, USA', NULL, 7470, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(19, 'Jared Joseph Leto (born December 26, 1971) is an American actor and musician. He began his career as a model before studying art, and then later, film and video. Leto gained fame during his role as Jordan Catalano in My So-Called Life. He has appeared in films such as Fight Club; Girl, Interrupted; Panic Room; American Psycho; Alexander; Requiem for a Dream; Lord of War, Prefontaine, Mr. Nobody and Suicide Squad. He is the lead vocalist, rhythm guitarist and main songwriter for the American rock band 30 Seconds to Mars and has directed music videos under the pseudonym Bartholomew Cubbins.', '1971-12-26 01:00:00.000', NULL, 'Jared Leto', '/fqxQG89T2IDPMl50gPa4PIFhAjV.jpg', 'Bossier City, Louisiana, USA', NULL, 7499, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(20, 'Helena Bonham Carter (born 26 May 1966) is an English actress of film, stage, and television. She made her film debut in K. M. Peyton''s A Pattern of Roses before winning her first leading role as the titular character in Lady Jane. She is known for her roles in films such as A Room with a View, Fight Club, and the Harry Potter series, as well as for frequently collaborating with director Tim Burton, her domestic partner since 2001. Bonham Carter is a two-time Academy Award nominee for her performances in The Wings of the Dove and The King''s Speech; her portrayal of Queen Elizabeth in the latter film garnering her a BAFTA Award in 2011. Description above from the Wikipedia article Helena Bonham Carter, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1966-05-26 01:00:00.000', NULL, 'Helena Bonham Carter', '/bP7brfFHq8Orj9iXeZUaJR8UcQR.jpg', 'Golders Green, London, England, UK', NULL, 1283, NULL);
