INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(23, 'From Wikipedia, the free encyclopedia. Eion Francis Hamilton Bailey (born June 8, 1976) is an American actor, perhaps best known for appearing in the HBO miniseries Band of Brothers as Pvt. David Kenyon Webster and in the films Fight Club, Center Stage, Mindhunters and Sexual Life. He currently has a recurring role on the USA Network TV show Covert Affairs. Description above from the Wikipedia article Eion Bailey, licensed under CC-BY-SA, full list of contributors on Wikipedia.â€‹', '1976-06-08 01:00:00.000', NULL, 'Eion Bailey', '/q3NEd6jP8k4AU5bbQYj8FR034GU.jpg', 'Santa Ynez Valley, California, USA', NULL, 7498, NULL);
