INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(28, 'Ezra Buzzington is "that guy" from "Oh, that guy!". He''s been in dozens of popular films but isn''t one you''d recognize on the street. He''s worked twice with David Fincher, Terry Zwigoff, Rob Zombie and Alexandre Aja. Other directors include George Clooney, the Farrelly Brothers, Paul Thomas Anderson and Chris Nolan. You know him. You just don''t know you know him.', NULL, NULL, 'Ezra Buzzington', '/dl0SIqpOqS05UpJHKuDQqZTwUvP.jpg', 'Muncie, Indiana', NULL, 59285, NULL);
