INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(30, 'David Andrew Leo Fincher (born August 28, 1962) is an American film director and music video director. Known for his dark and stylish thrillers, such as Seven (1995), The Game (1997), Fight Club (1999), Panic Room (2002), and Zodiac (2007), Fincher received Academy Award nominations for Best Director for his 2008 film The Curious Case of Benjamin Button and his 2010 film The Social Network, which also won him the Golden Globe and the BAFTA for best director.', '1962-08-28 01:00:00.000', NULL, 'David Fincher', '/h8bcpQocGCmlP3GN4LfST1Ga3iO.jpg', 'Denver, Colorado, USA', NULL, 7467, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(31, 'Thomas Jeffrey "Tom" Hanks (born July 9, 1956) is an American actor, producer, writer and director. Hanks worked in television and family-friendly comedies, gaining wide notice in 1988''s Big, before achieving success as a dramatic actor in several notable roles, including Andrew Beckett in Philadelphia, the title role in Forrest Gump, Commander James A. Lovell in Apollo 13, Captain John H. Miller in Saving Private Ryan, Joe Fox in You''ve Got Mail and Chuck Noland in Cast Away. Hanks won consecutive Best Actor Academy Awards, in 1993 for Philadelphia and in 1994 for Forrest Gump. U.S. domestic box office totals for his films exceed $3.9 billion.', '1956-07-09 01:00:00.000', NULL, 'Tom Hanks', '/4GQhsq83mfsGsLXdRsYZIrA694g.jpg', 'Concord, California, USA', NULL, 31, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(32, 'Robin Gayle Wright (born April 8, 1966) is an American actress. She is best known for her roles as Jenny Curran in Forrest Gump, as Buttercup in The Princess Bride, and as Mary Surratt in The Conspirator. She has also been credited as Robin Wright Penn. Description above from the Wikipedia article Robin Wright, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1966-04-08 01:00:00.000', NULL, 'Robin Wright', '/5bPTAtDX2TIxomKaZQZW0iZRkVP.jpg', 'Dallas, Texas, USA', NULL, 32, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(33, 'Gary Sinise ( born March 17, 1955) is an American actor, film director and musician. During his career, Sinise has won various awards including an Emmy and a Golden Globe Award and was nominated for an Academy Award. In 1992, Sinise directed, and played the role of George Milton in the successful film adaptation Of Mice and Men. Sinise was nominated for the Academy Award for Best Supporting Actor in 1994 for his role as Lt. Dan Taylor in Forrest Gump. He won a Golden Globe Award for his role in Truman, as Harry S. Truman. In 1996, he played a corrupt police officer in the dramatic hit Ransom, Detective Jimmy Shaker. In 1998, Sinise was awarded an Emmy Award for the television film George Wallace, a portrayal of the late George C. Wallace. Since 2004, Sinise has starred in CBS''s CSI: NY as Detective Mac Taylor. Description above from the Wikipedia article Gary Sinise, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1955-03-17 01:00:00.000', NULL, 'Gary Sinise', '/aa2DOJZWvTcYSvoEKJzwfulv3sc.jpg', 'Blue Island, Illinois, USA', NULL, 33, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(34, 'Michael T. "Mykelti" Williamson (born March 4, 1957) is an American actor best known for his role as Benjamin Buford (Bubba) Blue in the 1994 film Forrest Gump, as Detective Bobby "Fearless" Smith in the critically acclaimed but commercially unsuccessful crime drama Boomtown, and recently for appearing as the head of CTU for season 8 of the hit TV series 24.', '1957-03-04 01:00:00.000', NULL, 'Mykelti Williamson', '/8TTxzpuvvpw2tB8xZBCDslYupNU.jpg', 'Saint Louis, Missouri, USA', NULL, 34, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(35, 'â€‹From Wikipedia, the free encyclopedia. Sally Margaret Field (born November 6, 1946) is an American actress, singer, producer, director, and screenwriter. In each decade of her career, she has been known for major roles in American TV/film culture, including: in the 1960s, for Gidget (1965â€“66) or Sister Bertrille on The Flying Nun (1967â€“70); in the 1970s, for Sybil (1976), Smokey and the Bandit (1977) and Norma Rae (1979); in the 1980s, for Absence of Malice, Places in the Heart (1984) and Steel Magnolias; in the 1990s, forÂ Not Without My Daughter, Mrs. Doubtfire (1993) and Forrest Gump; and in the 2000s, on the TV shows ER and Brothers &amp; Sisters. She has also performed in numerous other roles. Field has won two Academy Awards, for Norma Rae (1979) and Places in the Heart (1984). She has also won three Emmy Awards: for her role in the TV film Sybil (1976); her guest-starring role on ER in 2000; and for her starring role as Nora Holden Walker on ABC''s series Brothers &amp; Sisters in 2007. She has also won two Golden Globes and the Screen Actors Guild Award for Best Actress. She also won the Best Female Performance Prize at the Cannes Film Festival, for Norma Rae (1979). Description above from the Wikipedia articleÂ Sally Â Field, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1946-11-06 01:00:00.000', NULL, 'Sally Field', '/u8MJBLnuwL5dUaiambBX8NPDC5b.jpg', 'Pasadena, California, USA', NULL, 35, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(36, 'Michael Conner Humphreys was born in 1985 in Independence, Mississippi, USA. He is an actor, known forÂ Forrest GumpÂ (1994),Â Pathfinders: In the Company of StrangersÂ (2011) andÂ Little ForrestÂ (2009).', '1970-01-01 01:00:02.000', NULL, 'Michael Conner Humphreys', '/vMEHkoxaJ7sn6rFYwfPLw2h6sb5.jpg', 'Independence - Mississippi - USA', NULL, 37821, NULL);
