INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(38, 'Haley Joel Osment (born April 10, 1988) is an American actor. After a series of roles in television and film during the 1990s, including a small part in Forrest Gump playing the title characterâ€™s son, Osment rose to fame with his performance as Cole Sear in M. Night Shyamalanâ€™s thriller film The Sixth Sense that earned him a nomination for Academy Award for Best Supporting Actor. He subsequently appeared in leading roles in several high-profile Hollywood films including Steven Spielberg''s A.I. Artificial Intelligence and Mimi Leder''s Pay it Forward. He made his Broadway debut in 2008 in a revival of American Buffalo, co-starring with John Leguizamo and Cedric the Entertainer.', '1988-04-10 02:00:00.000', NULL, 'Haley Joel Osment', '/znbiMgFoGnY3NMANOa8u13wJqFm.jpg', 'Los Angeles, California, USA', NULL, 9640, NULL);
