INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(45, 'From Wikipedia, the free encyclopedia. Robert Lee Zemeckis (born May 14, 1952) is an American film director, producer and screenwriter. Zemeckis first came to public attention in the 1980s as the director of the comedic time-travel Back to the Future film series, as well as the Academy Award-winning live-action/animation epic Who Framed Roger Rabbit (1988), though in the 1990s he diversified into more dramatic fare, including 1994''s Forrest Gump, for which he won an Academy Award for Best Director. His films are characterized by an interest in state-of-the-art special effects, including the early use of match moving in Back to the Future Part II (1989) and the pioneering performance capture techniques seen in The Polar Express (2004), Beowulf (2007) and A Christmas Carol (2009). Though Zemeckis has often been pigeonholed as a director interested only in effects, his work has been defended by several critics, including David Thomson, who wrote that "No other contemporary director has used special effects to more dramatic and narrative purpose." Description above from the Wikipedia article Robert Zemeckis, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1951-05-14 01:00:00.000', NULL, 'Robert Zemeckis', '/jJpbvGw4xTC8lWMqNYpLVCMMVV.jpg', 'Chicago, Illinois, USA ', NULL, 24, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(46, 'John Joseph "Jack" Nicholson (born April 22, 1937) is an American actor, film director, producer and writer. He is renowned for his often dark-themed portrayals of neurotic characters. Nicholson has been nominated for Academy Awards 12 times. He has won the Academy Award for Best Actor twice, for One Flew Over the Cuckoo''s Nest and for As Good as It Gets. He won the Academy Award for Best Supporting Actor for the 1983 film Terms of Endearment. He is tied with Walter Brennan for most acting wins by a male actor (three), and second to Katharine Hepburn for most acting wins overall (four). He is also one of only two actors nominated for an Academy Award for acting (either lead or supporting) in every decade from the 1960s to 2000s (the other one being Michael Caine). He has won seven Golden Globe Awards, and received a Kennedy Center Honor in 2001. In 1994, he became one of the youngest actors to be awarded the American Film Institute''s Life Achievement Award. Notable films in which he has starred include, in chronological order, Easy Rider, Five Easy Pieces, Chinatown, One Flew Over the Cuckoo''s Nest, The Shining, The Postman Always Rings Twice, Reds, Terms of Endearment, Batman, A Few Good Men, As Good as It Gets, About Schmidt, Something''s Gotta Give and The Departed. Description above from the Wikipedia article Jack Nicholson, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1937-04-22 01:00:00.000', NULL, 'Jack Nicholson', '/4DMNx9fW6sxDzoUwkpqCNHz8O8T.jpg', 'Manhattan, New York, USA', NULL, 514, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(47, 'â€‹From Wikipedia, the free encyclopedia. Louise Fletcher (born July 22, 1934) is an American actress best known for her role as Nurse Ratched in One Flew over the Cuckoo''s Nest for which she won the Academy Award for Best Actress and as Kai Winn Adami in Star Trek: Deep Space Nine. She also guest starred on the science fiction television series Heroes. She also received Emmy nominations for her guest starring roles in Picket Fences and Joan of Arcadia. Description above from the Wikipedia article Louise Fletcher, licensed under CC-BY-SA, full list of contributors on Wikipedia', '1934-07-22 01:00:00.000', NULL, 'Louise Fletcher', '/rI7ROzhC1G9ojMDvb8aVLwQsWkn.jpg', 'Birmingham, Alabama, USA', NULL, 7071, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(48, 'From Wikipedia, the free encyclopedia. Daniel Michael "Danny" DeVito, Jr. (born November 17, 1944 height 5'' (1,52 m)) is an American actor, comedian, director, and producer. He first gained prominence for his portrayal of Louie De Palma on the ABC and NBC TV series Taxi (1978â€“1983), for which he won a Golden Globe and an Emmy. DeVito and his wife, Rhea Perlman, founded Jersey Films, a production company known for films such as Pulp Fiction, Garden State, and Freedom Writers. DeVito also owns Jersey Television, which produced the Comedy Central series Reno 911!. DeVito and Perlman also starred together in his 1996 film Matilda, based on Roald Dahl''s children''s novel. He currently stars as Frank Reynolds on the FX sitcom It''s Always Sunny in Philadelphia. Description above from the Wikipedia article Danny DeVito, licensed under CC-BY-SA, full list of contributors on Wikipedia.â€‹', '1944-11-17 01:00:00.000', NULL, 'Danny DeVito', '/pX075f6nifILfeV8ZL15j8NxxEU.jpg', 'Asbury Park, New Jersey, USA', NULL, 518, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(49, 'From Wikipedia, the free encyclopedia. William Redfield (January 26, 1927 â€“ August 17, 1976) was an American actor and author who appeared in numerous theatrical, film, radio, and television roles. Description above from the Wikipedia article William Redfield (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia', '1927-01-26 01:00:00.000', NULL, 'William Redfield', '/5Tk02lfq65M4GT4lfCCfSais2Qg.jpg', 'New York City, New York, USA', NULL, 7072, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(50, 'â€‹From Wikipedia, the free encyclopedia Benjamin Sherman "Scatman" Crothers (May 23, 1910 â€“ November 22, 1986) was an American actor, singer, dancer and musician known for his work as Louie the Garbage Man on the TV show Chico and the Man, and as Dick Hallorann in The Shining in 1980. He was also a prolific voiceover artist, and provided the voices of Meadowlark Lemon in the animated TV version of The Harlem Globetrotters, Jazz the Autobot in The Transformers, the title character in Hong Kong Phooey, and Scat Cat in the 1970 film The Aristocats. Description above from the Wikipedia article Scatman Crothers, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1910-05-23 01:00:00.000', NULL, 'Scatman Crothers', '/n3REW3TGbjLC8SbaZG7g48pm98n.jpg', 'Terre Haute, Indiana, USA', NULL, 7077, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(51, 'From Wikipedia, the free encyclopedia Bradford Claude "Brad" Dourif (born March 18, 1950) is an American film and television actor who gained early fame for his portrayal of Billy Bibbit in One Flew Over the Cuckoo''s Nest, and has since appeared in a number of memorable roles, including the voice of Chucky in the Child''s Play franchise, Younger Brother in Ragtime, the mentat Piter De Vries in David Lynch''s Dune, GrÃ­ma Wormtongue in The Lord of the Rings, the homicidal Betazoid Lon Suder in the TV series Star Trek: Voyager, serial killer Charles Dexter/Brother Edward in the acclaimed science fiction television series Babylon 5, and Doc Cochran in the HBO television series Deadwood. Dourif has also worked with renowned film director Werner Herzog at many occasions, appearing in Scream of Stone, The Wild Blue Yonder, Bad Lieutenant: Port of Call New Orleans and My Son, My Son, What Have Ye Done?', '1950-03-18 01:00:00.000', NULL, 'Brad Dourif', '/ykd2SqIQSFLTjVjEhc8BKHjFcCM.jpg', 'Huntington, West Virginia, USA', NULL, 1370, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(52, 'From Wikipedia, the free encyclopedia. Christopher Allen Lloyd (born October 22, 1938) is an American actor. He is best known for playing Doc Brown in the Back to the Future trilogy, Uncle Fester in The Addams Family films, and Judge Doom in Who Framed Roger Rabbit. He played Reverend Jim Ignatowski in the television series Taxi and most recently Mr. Goodman in Piranha 3D. He also starred in the short-lived television series Deadly Games, and also was a regular in the short-lived TV series Stacked, in the mid-2000s. Lloyd has used his vocal talents in animation, frequently voicing villains. He currently voices the character Hacker on the animated PBS series Cyberchase. Lloyd has won three Primetime Emmy Awards and an Independent Spirit Award, and has been nominated for two Saturn Awards and a Daytime Emmy Award. Description above from the Wikipedia article Christopher Lloyd, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1938-10-22 01:00:00.000', NULL, 'Christopher Lloyd', '/hogpn2wd7yd6VbvD3iXdnDry77Y.jpg', 'Stamford, Connecticut, USA', NULL, 1062, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(53, 'From Wikipedia, the free encyclopedia Will Sampson (September 27, 1933 â€“ June 3, 1987) was an American actor and artist.  Sampson, a Native American Muscogee (Creek), was born in Okmulgee, Oklahoma and was an imposing 6'' 5" (1.96 m) tall. Sampson''s most notable roles were as "Chief Bromden" in One Flew Over the Cuckoo''s Nest and as "Taylor the Medicine Man" in the horror film Poltergeist II. He had a recurring role on the TV series Vega$, as Harlon Twoleaf and starred in the movies Fish Hawk, The Outlaw Josey Wales, and Orca. Sampson appeared in the production of Black Elk Speaks with the American Indian Theater Company in Tulsa, Oklahoma, where David Carradine and other Native American actors like Wes Studi and Randolph Mantooth starred in stage productions. Sampson competed in rodeos, his speciality riding bucking broncos, for about twenty years. He was on the rodeo circuit when the producers of One Flew Over the Cuckoo''s Nest, Saul Zaentz and Michael Douglas, were looking for a large Native American to play the role of Chief Bromden. A rodeo announcer told them about Sampson, and after lengthy efforts to find him, they hired him on the strength of an interview. He had never acted before. Sampson was also an artist. His large painting depicting the Ribbon Dance of his Muscogee people is in the collection of the Creek Council House Museum in Okmulgee, Oklahoma. His artwork is currently displayed online by The Kvskvnv (â€œkuskunaâ€�) Association. Description above from the Wikipedia article Will Sampson, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1933-09-27 01:00:00.000', NULL, 'Will Sampson', '/qcufMVWjaK0jlcDkkUZ6Kawvj2l.jpg', 'Okmulgee, Oklahoma, USA', NULL, 68301, NULL);
