INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(55, 'â€‹From Wikipedia, the free encyclopedia. Michael John Berryman (born September 4, 1948) is an American actor. He has appeared in several horror movies and other B movies. Berryman is famous for having a distinctive physical appearance as a result of hypohidrotic ectodermal dysplasia, a rare genetic condition which prevents him from developing hair, sweat glands or fingernails. According to his own statements in an interview for the DVD release of The Hills Have Eyes, he was born with "twenty-six birth defects." Description above from the Wikipedia article Michael Berryman, licensed under CC-BY-SA, full list of contributors on Wikipedia', '1948-09-04 02:00:00.000', NULL, 'Michael Berryman', '/vXvztwbkFc0Pz8ty0Jlaomo8P10.jpg', 'Los Angeles, California, USA', NULL, 7073, NULL);
