INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(58, 'Vincent Andrew Schiavelli was an American character actor and food writer noted for his work on stage, screen, and television, often described as "the man with the sad eyes." He was notable for his numerous supporting roles. Schiavelli was also well known for his height, standing 6 ft 6 in (1.98 m). He often attributed his unique facial appearance and great height to Marfan syndrome.', '1948-11-11 01:00:00.000', NULL, 'Vincent Schiavelli', '/9VAmZfthJ8pbDsJE8cJxIpnFcQy.jpg', ' Brooklyn, New York, USA', NULL, 3418, NULL);
