INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(60, 'Born Jan Tomas Forman in Caslav, Czechoslovakia, on February 18, 1932, a young Milos Forman lost his parents in the Nazi concentration camp at Auschwitz. He studied filmmaking in Prague and made several films in his native country during the 1960s, including his first, Magic Lantern II (1960), before leaving for America. His first American film, Taking Off (1971), received little attention. But the follow-up, One Flew Over the Cuckoo''s Nest (1975), was an unqualified success and earned Forman a Best Director Oscar. After adaptations of the musical "Hair" (1970) and the book Ragtime (1981), Forman directed the Mozart biography Amadeus (1984), which garnered a second Oscar for directing. He continued to strike gold in the biography genre with the Oscar-nominated The People vs. Larry Flynt (1996) and Man on the Moon (1999), which chronicled the bizarre life of comedian Andy Kaufman.', '1932-02-18 01:00:00.000', NULL, 'MiloÅ¡ Forman', '/nKnsrK9h02F1QlMetkyr9R45VGM.jpg', 'ÄŒÃ¡slav, ÄŒeskoslovensko', NULL, 3974, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(61, 'Alicia Christian "Jodie" Foster (born November 19, 1962) is an American actress, film director, producer as well as being a former child actress. Foster began acting in commercials at three years of age, and her first significant role came in the 1976 film Taxi Driver as the preteen prostitute Iris for which she received a nomination for the Academy Award for Best Supporting Actress. Also that year, she starred in the cult film The Little Girl Who Lives Down the Lane. She won an Academy Award for Best Actress in 1989 for playing a rape survivor in The Accused. In 1991, she starred in The Silence of the Lambs as Clarice Starling, a gifted FBI trainee, assisting in a hunt for a serial killer. This performance received international acclaim and her second Academy Award for Best Actress. She received her fourth Academy Award nomination for playing a hermit in Nell (1994). Other popular films include Maverick (1994), Contact (1997), Panic Room (2002), Flightplan (2005), Inside Man (2006), The Brave One (2007), and Nim''s Island (2008). Foster''s films have spanned a wide variety of genres, from family films to horror. In addition to her two Academy Awards she has won two BAFTA Awards for three films, two Golden Globe Awards, a Screen Actors Guild Award, a People''s Choice Award, and has received two Emmy nominations. Description above from the Wikipedia article Jodie Foster, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1962-11-19 01:00:00.000', NULL, 'Jodie Foster', '/ICuiQphW88Gr8XWfJnexxIDkOb.jpg', 'Los Angeles, Californie, Ã‰tats-Unis', NULL, 1038, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(62, 'Anthony Hopkins was born on 31 December 1937, in Margam, Glamorgan, Wales. Influenced by Richard Burton, he decided to study at College of Music and Drama in Cardiff and graduated in 1957. In 1965, he moved to London and joined the National Theatre, invited by Laurence Olivier, who could see the talent in Hopkins. In 1967, he made his first film for television, A Flea in Her Ear (1967) (TV). From this moment on, he enjoyed a successful career in cinema and television. In 1968, he worked on The Lion in Winter (1968) with Timothy Dalton. Many successes came later, and Hopkins'' remarkable acting style reached the four corners of the world. In 1977, he appeared in two major films: A Bridge Too Far (1977) with James Caan, Gene Hackman, Sean Connery, Michael Caine, Elliott Gould and Laurence Olivier, and Maximilian Schell. In 1980, he worked on The Elephant Man (1980). Two good television literature adaptations followed: Othello (1981) (TV) and "Hallmark Hall of Fame: The Hunchback of Notre Dame (#31.2)" (1982). In 1987 he was awarded with the Commander of the order of the British Empire. This year was also important in his cinematic life, with 84 Charing Cross Road (1987), acclaimed by specialists. In 1993, he was knighted. In the 1990s, Hopkins made movies like Desperate Hours (1990) and Howards End (1992), The Remains of the Day (1993) (nominee for the Oscar), Legends of the Fall (1994), Nixon (1995) (nominee for the Oscar), Surviving Picasso (1996), Amistad (1997) (nominee for the Oscar), The Mask of Zorro (1998), Meet Joe Black (1998) and Instinct (1999). His most remarkable film, however, was The Silence of the Lambs (1991), for which he won the Oscar for Best Actor. He also got a BAFTA for this role. IMDb Mini Biography By: Emerenciano', '1937-12-31 01:00:00.000', NULL, 'Anthony Hopkins', '/btweZvSRBiE6jaMME93BSXeTQN6.jpg', 'Margam, Port Talbot, Glamorgan, Wales, UK', NULL, 4173, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(63, 'Theodore Scott Glenn (born January 26, 1941) is an American actor. His roles have included Wes Hightower in Urban Cowboy (1980), astronaut Alan Shepard in The Right Stuff (1983), Commander Bart Mancuso in The Hunt for Red October (1990), and Jack Crawford in The Silence of the Lambs (1991). Description above from the Wikipedia article Scott Glenn, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1941-01-26 02:00:00.000', NULL, 'Scott Glenn', '/gjVe5sizXzlw9HfUIY9jB5C8pBB.jpg', 'Pittsburgh - Pennsylvania - USA', NULL, 349, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(64, 'Frank Theodore "Ted" Levine (born May 29, 1957) is an American actor. He is known for his roles as Buffalo Bill in The Silence of the Lambs and Captain Leland Stottlemeyer in the television series Monk.', '1957-05-29 01:00:00.000', NULL, 'Ted Levine', '/7O3vgqgicfNeGr3leC0qB074fjX.jpg', 'Parma, Ohio', NULL, 15854, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(65, 'Philip Anthony Mair Heald, known professionally as Anthony Heald (born August 25, 1944), is an American actor known for portraying Hannibal Lecter''s jail nemesis, Dr. Frederick Chilton in The Silence of the Lambs and Red Dragon, and for playing assistant principal Scott Guber in David E. Kelley''s Boston Public. He also had a recurring role as Judge Cooper on Kelley''s The Practice and Boston Legal. Description above from the Wikipedia article Anthony Heald, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1944-08-25 02:00:00.000', NULL, 'Anthony Heald', '/t5vSpyb7KcnJIjjSExxbmJPseap.jpg', 'New Rochelle - New York - USA', NULL, 16293, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(66, 'From Wikipedia, the free encyclopedia. Brooke Smith (born May 22, 1967) is an American actress. She is best known for her role on the TV show Grey''s Anatomy as Dr. Erica Hahn and for her role as Catherine Martin in the 1991 film The Silence of the Lambs. Description above from the Wikipedia article Brooke Smith, licensed under CC-BY-SA, full list of contributors on Wikipedia', '1967-05-22 01:00:00.000', NULL, 'Brooke Smith', '/5EmnAJyp8JBH0EXuookdUmhYR8U.jpg', 'New York City, New York, USA', NULL, 31649, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(67, 'â€‹From Wikipedia, the free encyclopedia. Â   Diane Carol Baker (born February 25, 1938) is an American actress who has appeared in motion pictures and on television since 1959.  Description above from the Wikipedia article Diane Baker, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1938-02-25 01:00:00.000', NULL, 'Diane Baker', '/pExT2sv2tCRBxNzGKKNf2cdYI2q.jpg', 'Hollywood, California, USA', NULL, 6930, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(68, 'Kasi Lemmons (born Karen Lemmons on February 24, 1961 ) is an American film director and actress, most notable for her work on the films Eve''s Bayou, The Caveman''s Valentine and Talk to Me. Lemmons was born in St. Louis, Missouri, the daughter of a poet/psychotherapist mother and a biology teacher father.Â  When Lemmons was eight years old, her parents divorced, and she and her mother and two sisters moved to Newton, Massachusetts. Her mother remarried when she was nine. Her passion for movies came at an early age, but becoming a director was her goal. "I wanted to do something more meaningful than going to auditionsâ€¦" Lemmons is married to actor and director Vondie Curtis-Hall. They have a son, Henry Hunter (born 1996), and a daughter, Zora (1999). Lemmons states that her husband is immensely supportive and feels that he is more relaxed than she is. Compared to how he works, she prefers the pressure of working on a set with the actors. As a director and a mother, Lemmons says that it gives her perspective. Her life outside of the movie set and Hollywood has kept her grounded. Though she is a Black woman, Lemmons identifies herself as an artist first and foremost in her career. "â€¦I donâ€™t wake up every day saying Iâ€™m a Black woman because itâ€™s too given, but I wake up every day feeling like an artist and I feel Iâ€™m an artist." Description above from the Wikipedia article Kasi Lemmons, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1961-02-24 01:00:00.000', NULL, 'Kasi Lemmons', '/dO8h85dpcoVFkKwa8MMOacRro4F.jpg', 'St. Louis, Missouri, USA', NULL, 51864, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(69, 'Frankie Faison is anÂ AmericanÂ stage and screen actor, bestÂ known for his role as Deputy CommissionerÂ Ervin BurrellÂ in HBO''s television seriesÂ "The Wire",Â and as Barney Matthews in theÂ "Hannibal Lecter" franchise.Â He studied Drama atÂ Wesleyan University, Bloomington, Illinois, and graduated from New York Universities''Â Acting Program.', '1949-06-10 02:00:00.000', NULL, 'Frankie Faison', '/hQ3eh75xtCdxEZCeGaw1q67w593.jpg', 'Newport News, Virginia, USA', NULL, 13936, NULL);
