INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(74, 'From Wikipedia, the free encyclopedia. Daniel Eugene Butler (born December 2, 1954) is an American playwright and actor known for his role as Bob "Bulldog" Briscoe on the TV series Frasier. Butler was born in Huntington, Indiana and raised in Fort Wayne; the son of Shirley, a homemaker, and Andrew Butler, a pharmacist. Openly gay, he starred in Terrence McNally''s 1989 play The Lisbon Traviata and wrote an Off Broadway play about his life, The Only Thing Worse You Could Have Told Me..., which derives its title from a comment Butler''s father allegedly made when Dan came out to him. Though Butler never hid his homosexuality, he disclosed it publicly on Entertainment Tonight in 1994 during his run as a swaggering heterosexual on Frasier. His partner is acting teacher and director, Richard Waterhouse. Description above from the Wikipedia article Dan Butler, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1954-12-02 01:00:00.000', NULL, 'Dan Butler', '/1JpxhswGPAkx3prXVZUpc7aM0uD.jpg', 'Huntington, Indiana, USA', NULL, 76470, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(75, 'Robert Jonathan Demme (born February 22, 1944) was an American filmmaker, producer and screenwriter. He was best known for directing The Silence of the Lambs, which won him the Academy Award for Best Director. He later directed the acclaimed films Philadelphia (1993) and Rachel Getting Married (2008). On April 26, 2017, Demme died at the age of 73 in Manhattan due to complications from esophageal cancer and heart disease. Description above from the Wikipedia article Jonathan Demme, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1944-02-22 01:00:00.000', NULL, 'Jonathan Demme', '/suxo4qCWhq2Giep8UKhrf8bF4vc.jpg', 'Baldwin, Long Island, New York, USA', NULL, 16294, NULL);
