INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(90, 'Hayao Miyazaki (Miyazaki Hayao, born January 5, 1941) is a Japanese manga artist and prominent film director and animator of many popular anime feature films. Through a career that has spanned nearly five decades, Miyazaki has attained international acclaim as a maker of animated feature films and, along with Isao Takahata, co-founded Studio Ghibli, an animation studio and production company. The success of Miyazaki''s films has invited comparisons with American animator Walt Disney, British animator Nick Park as well as Robert Zemeckis, who pioneered Motion Capture animation, and he has been named one of the most influential people by Time Magazine. Miyazaki began his career at Toei Animation as an in-between artist for Gulliver''s Travels Beyond the Moon where he pitched his own ideas that eventually became the movie''s ending. He continued to work in various roles in the animation industry over the decade until he was able to direct his first feature film Lupin III: The Castle of Cagliostro which was published in 1979. After the success of his next film, NausicaÃ¤ of the Valley of the Wind, he co-founded Studio Ghibli where he continued to produce many feature films until Princess Mononoke whereafter he temporarily retired. While Miyazaki''s films have long enjoyed both commercial and critical success in Japan, he remained largely unknown to the West until Miramax released his 1997 film, Princess Mononoke. Princess Mononoke was the highest-grossing film in Japanâ€”until it was eclipsed by another 1997 film, Titanicâ€”and the first animated film to win Picture of the Year at the Japanese Academy Awards. Miyazaki returned to animation with Spirited Away. The film topped Titanic''s sales at the Japanese box office, also won Picture of the Year at the Japanese Academy Awards and was the first anime film to win an American Academy Award. Miyazaki''s films often incorporate recurrent themes, such as humanity''s relationship to nature and technology, and the difficulty of maintaining a pacifist ethic. Reflecting Miyazaki''s feminism, the protagonists of his films are often strong, independent girls or young women. Miyazaki is a vocal critic of capitalism and globalization.[3] While two of his films, The Castle of Cagliostro and Castle in the Sky, involve traditional villains, his other films such as Nausicaa or Princess Mononoke present morally ambiguous antagonists with redeeming qualities.', '1941-01-05 02:00:00.000', NULL, 'Hayao Miyazaki', '/8NwdEHc3zpeaZs8IgEYQV7Nlse6.jpg', 'Tokyo', NULL, 608, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(91, 'Humphrey DeForest Bogart (December 25, 1899 â€“ January 14, 1957) was an American actor. He is widely regarded as a cultural icon. The American Film Institute ranked Bogart as the greatest male star in the history of American cinema. After trying various jobs, Bogart began acting in 1921 and became a regular in Broadway productions in the 1920s and 1930s. When the stock market crash of 1929 reduced the demand for plays, Bogart turned to film. His first great success was as Duke Mantee in The Petrified Forest (1936), and this led to a period of typecasting as a gangster with films such as Angels with Dirty Faces (1938) and B-movies like The Return of Doctor X (1939). His breakthrough as a leading man came in 1941, with High Sierra and The Maltese Falcon. The next year, his performance in Casablanca raised him to the peak of his profession and, at the same time, cemented his trademark film persona, that of the hard-boiled cynic who ultimately shows his noble side. Other successes followed, including To Have and Have Not (1944), The Big Sleep (1946), Dark Passage (1947) and Key Largo (1948), with his wife Lauren Bacall; The Treasure of the Sierra Madre (1948); The African Queen (1951), for which he won his only Academy Award; Sabrina (1954) and The Caine Mutiny (1954). His last movie was The Harder They Fall (1956). During a film career of almost thirty years, he appeared in 75 feature films. Description above from the Wikipedia article Humphrey Bogart, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1899-12-25 01:00:00.000', NULL, 'Humphrey Bogart', '/z9ramp7p7wcyfpKhj2z5BqIqqWi.jpg', 'New York City, New York, USA', NULL, 4110, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(92, 'Ingrid Bergman (29 August 1915 â€“ 29 August 1982) was a Swedish actress who starred in a variety of European and American films. She won three Academy Awards, two Emmy Awards, and the Tony Award for Best Actress. She is ranked as the fourth greatest female star of American cinema of all time by the American Film Institute. She is best remembered for her roles as Ilsa Lund in Casablanca (1942), a World War II drama co-starring Humphrey Bogart and as Alicia Huberman in Notorious (1946), an Alfred Hitchcock thriller co-starring Cary Grant. Before becoming a star in American films, she had already been a leading actress in Swedish films. Her first introduction to American audiences came with her starring role in the English remake of Intermezzo in 1939. In America, she brought to the screen a "Nordic freshness and vitality", along with extreme beauty and intelligence, and according to the St. James Encyclopedia of Popular Culture, she quickly became "the ideal of American womanhood" and one of Hollywood''s greatest leading actresses. Her producer David O. Selznick, who called her "the most completely conscientious actress" he had ever worked with, gave her a seven-year acting contract, thereby assuring her continual stardom. A few of her other starring roles, besides Casablanca, included For Whom the Bell Tolls (1943), Gaslight (1944), The Bells of St. Mary''s (1945), Alfred Hitchcock''s Spellbound (1945), Notorious (1946), and Under Capricorn (1949), and the independent production, Joan of Arc (1948). In 1950, after a decade of stardom in American films, she starred in the Italian film Stromboli, which led to a love affair with director Roberto Rossellini while they were both already married. The affair created a scandal that forced her to return to Europe until 1956, when she made a successful Hollywood comeback in Anastasia, for which she won her second Academy Award, as well as the forgiveness of her fans. Many of her personal and film documents can be seen in the Wesleyan University Cinema Archives. Description above from the Wikipedia article Ingrid Bergman , licensed under CC-BY-SA, full list of contributors on Wikipedia.Â ', '1915-08-29 01:00:00.000', NULL, 'Ingrid Bergman', '/iwU6mXNKj6VFvsGIEnNKu4UbXUL.jpg', 'Stockholm, Sweden', NULL, 4111, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(93, 'From Wikipedia, the free encyclopedia. Paul Henreid (10 January 1908 â€“ 29 March 1992), whose birthname was Paul Georg Julius Hernreid Ritter von Wassel-Waldingau, was an Austrian actor and film director. Henreid''s best remembered role is as Victor Laszlo in Casablanca (1942). Description above from the Wikipedia article Paul Henreid, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1908-01-10 01:00:00.000', NULL, 'Paul Henreid', '/eWRFO86IttlVeHAlrWLyig8pm2m.jpg', 'Trieste, Austria-Hungary', NULL, 4112, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(94, 'Claude Rains (10 November 1889 â€“ 30 May 1967) was an English stage and film actor whose career spanned 47 years; he later held American citizenship. He was known for many roles in Hollywood  films, among them the title role in The Invisible Man (1933), a corrupt senator in Mr. Smith Goes to Washington  (1939), and, perhaps his most famous performance, Captain Renault in Casablanca (1942). Rains was born William Claude Rains in Camberwell, London on November 10, 1889. He grew up, according to his daughter, with "a very serious cockney accent and a speech impediment".  His father was British stage actor Frederick Rains, and the young Rains made his stage debut at 11 in Nell of Old Drury. His acting talents were recognised by Sir Herbert Beerbohm Tree, founder of The Royal Academy of Dramatic Art. Tree paid for the elocution lessons Rains needed in order to succeed as an actor. Later, Rains taught at the institution, teaching John Gielgud and Laurence Olivier, among others. Rains served in the First World War in the London Scottish Regiment, with fellow actors Basil Rathbone, Ronald Colman and Herbert Marshall. Rains was involved in a gas attack that left him nearly blind in one eye for the rest of his life. However, the war did aid his social advancement and, by its end, he had risen from the rank of Private to Captain. Rains began his career in the London theatre, having a success in the title role of John Drinkwater''s play Ulysses S. Grant, the follow-up to the playwright''s major hit Abraham Lincoln, and traveled to Broadway in the late 1920s to act in leading roles in such plays as Shaw''s The Apple Cart and in the dramatizations of The Constant Nymph, and Pearl S. Buck''s novel The Good Earth, as a Chinese farmer. Rains came relatively late to film acting and his first screen test was a failure, but his distinctive voice won him the title role in James Whale''s The Invisible Man (1933) when someone accidentally overheard his screen test being played in the next room. Rains later credited director Michael Curtiz with teaching him the more understated requirements of film acting, or "what not to do in front of a camera".', '1889-11-10 01:00:00.000', NULL, 'Claude Rains', '/Ai8dxQY9p90n3YO9o3J6iEqxZ04.jpg', 'London, England, UK', NULL, 4113, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(95, 'â€‹From Wikipedia, the free encyclopedia. Conrad Veidt (22 January 1893 â€“ 3 April 1943) was a German actor best remembered for his roles in films such as The Cabinet of Dr. Caligari (1919), The Man Who Laughs (1928), The Thief of Bagdad (1940) and Casablanca (1942). After a successful career in German silent film, where he was one of the best paid stars of Ufa, he left Germany in 1933 with his new Jewish wife and settled in the United Kingdom, where he participated in a number of films before continuing to the United States around 1941. Description above from the Wikipedia articleÂ Conrad VeidtÂ licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1893-01-22 01:00:00.000', NULL, 'Conrad Veidt', '/dfOSkNseKWva6mNItPMvM1RB05E.jpg', 'Potsdam, Brandenburg, Germany', NULL, 3001, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(96, 'â€‹From Wikipedia, the free encyclopedia. Sydney Hughes Greenstreet Â (27 December 1879 â€“ 18 January 1954) was an English actor. He is best known for his Warner Bros. films with Humphrey Bogart and Peter Lorre, which include The Maltese Falcon (1941) and Casablanca (1942). Description above from the Wikipedia article Sydney Greenstreet, licensed under CC-BY-SA, full list of contributors on Wikipedia', '1879-12-27 01:00:00.000', NULL, 'Sydney Greenstreet', '/tXSc0cmUmsMqbR3A3xbevNfp3N7.jpg', 'Sandwich, Kent, England, UK', NULL, 4114, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(97, 'From Wikipedia, the free encyclopedia. Peter Lorre (26 June 1904 â€“ 23 March 1964) was an Austrian-American actor frequently typecast as a sinister foreigner. He caused an international sensation in 1931 with his portrayal of a serial killer who preys on little girls in the German film M. Later he became a popular featured player in Hollywood crime films and mysteries, notably alongside Humphrey Bogart and Sydney Greenstreet, and as the star of the successful Mr. Moto detective series. Description above from the Wikipedia article Peter Lorre, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1904-06-26 01:00:00.000', NULL, 'Peter Lorre', '/iptNcYkL4RtkP0hwiH5xZ3lN6Hq.jpg', 'RÃ³zsahegy (now RuÅ¾omberok), Austria-Hungary (now Slovakia)', NULL, 2094, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(98, 'From Wikipedia, the free encyclopedia. SzÅ‘ke SzakÃ¡llÂ  (February 2, 1883 â€“ February 12, 1955), known as S.Z. Sakall, was a Hungarian film character actor. He was in many films including In the Good Old Summertime, Lullaby of Broadway, Christmas in Connecticut and Casablanca in which he played Carl, the head waiter. Chubby-jowled Sakall played numerous supporting roles in Hollywood musicals and comedies in the 1940s and 1950s. His rotund cuteness earned Sakall the nickname "Cuddles," and he was often billed as S.Z. "Cuddles" Sakall in his later films, though he was never happy with the name. He was famous for using the phrase "everything is hunky dunky." Description above from the Wikipedia article S. Z. Sakall, licensed under CC-BY-SA, full list of contributors on Wikipedia', '1884-02-02 01:00:00.000', NULL, 'S.Z. Sakall', '/9dV6JB48tQKlXUzeqyI12r0xrD8.jpg', NULL, NULL, 94110, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(99, 'Madeleine LeBeau, was a French actress who playedÂ Humphrey Bogartâ€™s jilted mistress Yvonne, in â€œCasablanca,â€�  In â€œCasablanca,â€� LeBeau gets teary-eyed when â€œLa Marseillaiseâ€� is played and shouts â€œViva la France!â€� She was among several cast members who were actually refugees from the German occupation.  Her life echoedÂ the film: After she made her screen debut in French film â€œGirls in Distressâ€� in 1939, LeBeau and her husband, actorÂ Marcel Dalio, fled Paris for Portugal. They were said to have received transit visas that allowed them to enter Spain and then Portugal before continuing on towards Chile. They were stranded in Mexico when their visas turned out to be forgeries and were able to enter the United States with temporary Canadian passports.Â ', '1923-06-10 01:00:00.000', NULL, 'Madeleine Lebeau', '/tYUnGiQEBJLG1OfeqHvdcANgm2I.jpg', NULL, NULL, 4116, NULL);
