INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(103, 'Leonid Kinskey (April 18, 1903 â€“ September 8, 1998) was a Russian-born movie and television actor who enjoyed a long career. Kinskey is best known for his role as Sascha in the film Casablanca (1942). Kinskey was born in St. Petersburg, Russia. He fled the Russian Revolution and acted on stage in Europe and South America before arriving in New York City in 1921. He joined the road production of Al Jolson''s musical Wonder Bar, before making his first film appearance, in the 1932 Trouble in Paradise. His looks and accent helped him land supporting roles in numerous movies, including Duck Soup and Nothing Sacred, and on television, well into the 1960s. It is said that he got perhaps his best-known role, Sascha in Casablanca, because he was a drinking buddy of star Humphrey Bogart. Kinskey was in the pilot episode for Hogan''s Heroes, but turned down a regular role in the series because he thought the subject matter was being taken too lightly. Kinskey was married three times. His second wife was actress Iphigenie Castiglioni, to whom he remained married until her death in 1963. He was married to Tina York from 1983 to his death. He died of complications of a stroke in Fountain Hills, Arizona, at the age of 95. Description above from the Wikipedia article Leonid Kinskey, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1903-04-18 01:00:00.000', NULL, 'Leonid Kinskey', '/fM1pWZWlFdJZjyEOKSILNjbTYFn.jpg', 'St. Petersburg, Russia', NULL, 4120, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(104, 'From Wikipedia, the free encyclopedia.  Curt Bois (April 5, 1901 â€“ December 25, 1991) was a German actor. He is best remembered for his performance as the Pickpocket in Casablanca (1942). Bois was born in Berlin and began acting in 1907, becoming one of the film world''s first child actors, with a role in the silent movie Bauernhaus und GrafenschloÃŸ. In 1909, he played the title role in Der Kleine Detektiv (''The Little Detective''). Bois'' acting career spanned eighty years, a longer period than can be claimed by any other actor. His final performance was in 1987''s Der Himmel Ã¼ber Berlin (Wings of Desire). Bois performed in theatre, cabaret, musicals, silent film and "talkies" over his career as an actor. In 1934, Bois was forced to leave his home for the United States, where he found work on stage on Broadway. By 1937, he had found his way to Hollywood, and began acting in American pictures, the best-known of which was Casablanca (1942), with a single speech warning about pickpockets as "vultures everywhere". After World War II Bois decided it was safe to return to Germany, which he did in 1950. He finished his life and career in Germany, first in the East, and finally in the West. Bois died in Berlin, the city of his birth, at the age of ninety. Description above from the Wikipedia article Curt Bois, licensed under CC-BY-SA, full list of contributors on Wikipedia.  Â Â Â ', '1901-04-05 01:00:00.000', NULL, 'Curt Bois', '/1gP0LUXNziPEgKXAfHKNBnnJx6h.jpg', 'Berlin, Germany', NULL, 2313, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(105, 'From Wikipedia, the free encyclopedia. Â  Michael Curtiz (December 24, 1886 â€” April 10, 1962) was a Hungarian-American film director.He had early credits as MihÃ¡ly KertÃ©sz and Michael KertÃ©sz. He directed more than fifty films in Europe and more than one hundred in the United States. The best-known were The Adventures of Robin Hood, Angels with Dirty Faces, Casablanca, Yankee Doodle Dandy, and White Christmas. He thrived in the heyday of the Warner Bros. studio in the 1930s and ''40s. He was less successful from the late 1940s onwards, when he attempted to move from studio direction into production and freelance work, but he continued working until shortly before his death. Description above from the Wikipedia article Michael Curtiz, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1886-12-24 01:00:00.000', NULL, 'Michael Curtiz', '/6I1ChzgQvAV3RR48K40hdi3okFX.jpg', 'Budapest, Hungary', NULL, 4109, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(106, 'Russell Ira Crowe (born 7 April 1964) is a New Zealand-born Australian actor and musician. His acting career began in the late 1980s with roles in Australian television series including Police Rescue and Neighbours. In the early 1990s, Crowe''s local prominence peaked when he won the Australian Film Industry Award for Best Actor for his portrayal of an inner-city skinhead in the Geoffrey Wright film, Romper Stomper. In the late 1990s, Crowe transferred his acting ambitions to the USA with his breakout role in L.A. Confidential (1997). Crowe won the Academy Award for Best Actor for Gladiator in 2001 and has received three Academy Award nominations for Best Actor in a Leading Role: The Insider (1999), Gladiator (2000) and A Beautiful Mind (2001). He is also co-owner of National Rugby League team the South Sydney Rabbitohs. Description above from the Wikipedia article Russell Crowe, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1964-04-07 01:00:00.000', NULL, 'Russell Crowe', '/mM2idgQvN0VmxV7RP1gDjNuz587.jpg', 'Wellington, New Zealand', NULL, 934, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(107, 'American film actor Joaquin Rafael Phoenix, born Joaquin Rafael Bottom has ventured behind the camera, directing music videos as well as producing movies and television shows. Phoenix recorded an album, the soundtrack to â€œWalk the Lineâ€�. He is also known for his work as a social activist, particularly as an advocate for animal rights. Phoenix''s first acting jobs were guest appearances on two television shows with his brother River in Seven Brides for Seven Brothers (1982) and Backwards: The Riddle Of Dyslexia (1984). He made his big-screen debut in Space Camp (1986), playing the role of Max, after starring in an Alfred Hitchcock Presents episode "A very happy ending" the same year. His first starring role was in Russkies (1987). He later co-starred in Ron Howard''s Parenthood (1989), in which he was credited as Leaf Phoenix. Phoenix served as one of the executive producers of a television show called 4Real, a half-hour series which showcase celebrity guests on global adventures "in order to connect with young leaders who are creating social and economic change." He is also listed as a producer on the movie We Own the Night. He has directed music videos for the following bands: Ringside, She Wants Revenge, People in Planes, Arckid, Albert Hammond Jr., and Silversun Pickups.', '1974-10-28 01:00:00.000', NULL, 'Joaquin Phoenix', '/3IhxPwyUovZGbsdwhcaU0Kvm37J.jpg', 'San Juan, Puerto Rico', NULL, 73421, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(108, 'Connie Inge-Lise Nielsen (born 3 July 1965) is a Danish actress. She is known for her roles in the English language films Gladiator, The Devil''s Advocate, Basic, and The Ice Harvest. Description above from the Wikipedia article Connie Nielsen, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1965-07-03 01:00:00.000', NULL, 'Connie Nielsen', '/paemXRvpJZhyqTuMViPgztKVuOy.jpg', 'Elling, Frederikshavn, Denmark', NULL, 935, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(109, 'From Wikipedia, the free encyclopedia. Oliver Reed (13 February 1938 â€“ 2 May 1999) was an English actor known for his burly screen presence. Reed exemplified his real-life macho image in "tough guy" roles. His films include The Trap, Oliver!, Women in Love, Hannibal Brooks, The Triple Echo, The Devils, The Three Musketeers, Tommy, Castaway, Lion of the Desert and Gladiator. Description above from the Wikipedia article Oliver Reed, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1938-02-13 01:00:00.000', NULL, 'Oliver Reed', '/paRSMps1RfskzgkTBJTHvjHgmJe.jpg', 'Wimbledon, London, England, UK', NULL, 936, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(110, 'Richard St. John Harris was an Irish actor, singer-songwriter, theatrical producer, film director and writer. He appeared on stage and in many films, and is perhaps best known for his roles as King Arthur in Camelot (1967), as Oliver Cromwell in Cromwell (1970) and as Albus Dumbledore in Harry Potter and the Philosopher''s Stone (2001) and Harry Potter and the Chamber of Secrets (2002), his last film. He also played a British aristocrat and prisoner in A Man Called Horse (1970) and a gunfighter in Clint Eastwood''s Western film Unforgiven (1992). As a singer, Harris is probably best remembered for his recording of Jimmy Webb''s song "MacArthur Park", which reached the top ten in sales on both sides of the Atlantic Ocean in 1968. Harris, the fifth of nine children, was born in Limerick City, County Limerick, Munster, Ireland, the son of Ivan John Harris and Mildred Josephine Harty Harris. In 1957, he married Elizabeth Rees-Williams, the daughter of David Rees-Williams, 1st Baron Ogmore. Their three children are the actor Jared Harris, the actor Jamie Harris, and the director Damian Harris. Harris and Rees-Willams divorced in 1969, and then Elizabeth married another well-known actor, Sir Rex Harrison. Harris'' second marriage was to the American actress Ann Turkel, who was 16 years younger than he, and this marriage also ended in a divorce. Despite his divorces, Harris was a member of the Roman Catholic Knights of Malta, and was also dubbed a knight by the Queen of Denmark in 1985. Harris was a life long friend of actor Peter O''Toole. Harris died of Hodgkin''s disease on 25 October 2002, aged 72, two and a half weeks before the American premiere of Harry Potter and the Chamber of Secrets. He was replaced as Dumbledore by the Irish-born actor Sir Michael Gambon. For years, whenever he was in London, Harris resided at the Savoy Hotel. According to the hotel archivist Susan Scott, as Harris was being taken from the hotel on a stretcher, shortly before his death, he warned the diners, "It was the food!" Harris''s remains were cremated, and his ashes were scattered in The Bahamas Islands, where he had owned a home.', '1930-10-01 01:00:00.000', NULL, 'Richard Harris', '/64jkJJtL5sins6nwGKOERduLSEA.jpg', 'Limerick City, Munster, Ireland', NULL, 194, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(111, 'From Wikipedia, the free encyclopedia. Sir Derek George Jacobi, CBE, (born 22 October 1938) is an English actor and film director. A "forceful, commanding stage presence", Jacobi has enjoyed a highly successful stage career, appearing in such stage productions as Hamlet, Uncle Vanya, and Oedipus the King. He received a Tony Award for his performance in Much Ado About Nothing. His stage work also includes playing notable historical figures such as Edward II, Octavius Caesar, Richard III of England, and Cyrano de Bergerac. In addition to being a founder member of the Royal National Theatre and winning several prestigious theatre awards, Jacobi has also enjoyed a successful television career, appearing in the critically praised adaptation I, Claudius, for which he won a BAFTA; the titular role in the acclaimed medieval drama series Brother Cadfael, and Stanley Baldwin in The Gathering Storm. Though principally a stage actor, Jacobi has appeared in a number of films, such as Henry V (1989), Dead Again (1991), Gladiator (2000), Gosford Park (2001), The Golden Compass (2007), The King''s Speech (2010), and the forthcoming Hippie Hippie Shake. Like Laurence Olivier, he holds two knighthoods, Danish and British. Description above from the Wikipedia article Derek Jacobi, licensed under CC-BY-SA, full list of contributors on Wikipedia', '1938-10-22 01:00:00.000', NULL, 'Derek Jacobi', '/jJ4MkVS59gCfJhWMfLTbeHKjoyC.jpg', 'Leytonstone, London, England', NULL, 937, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(112, 'Djimon Gaston Hounsou is a Beninese-American actor and model. As an actor, Hounsou has been nominated for two Academy Awards. Hounsou became a naturalized American citizen in 2007. He was reluctant to renounce his Beninese citizenship and therefore opted to become a dual citizen of both Benin and the United States, effectively rendering him a Beninese-American. Djimon Hounsou was born in Cotonou, Benin, in 1964, to lbertine and Pierre Hounsou. He immigrated to Lyon in France at the age of thirteen with his brother, Edmond. In 1987, he became a model and established a career in Paris. He moved to the U.S. in 1990. One year before obtaining his college degree, he dropped out of school. In the 1989 he appeared in a music video of Straight Up by Paula Abdul. Hounsou''s film debut was in the 1990 Sandra Bernhard film Without You Iâ€™m Nothing, and he has had television parts on Beverly Hills, 90210 and ER and a guest starring role on Alias, but received a larger role in the science fiction film Stargate. His first on-screen appearance was in the 1990 Janet Jackson video â€œLove Will Never Do (Without You).â€� He also starred in a 2002 Gap commercial directed by Peter Lindbergh, dancing to a rendition of John Lee Hooker''s "Boom Boom" by Arrested Development''s Baba Oje. He received wide critical acclaim and a Golden Globe Award nomination for his role as CinquÃ© in the 1997 Steven Spielberg film Amistad. He gained further notice as Juba, in the 2000 film Gladiator. He was nominated for the Academy Award for Best Supporting Actor, for In America, in 2004, becoming the fourth African male to be nominated for an Oscar (along with Basil Rathbone, Cecil Kellaway and Omar Sharif). In 2006, he won the National Board of Review Award for Best Supporting Actor for his performance in Blood Diamond; he received Broadcast Film Critics Association, Screen Actors Guild Award, and Academy Award nominations for this performance. In 2007, Hounsou began dating model/CEO of Baby Phat, Kimora Lee Simmons. In 2008 Hounsou and Simmons visited Hounsou''s family and while there, the two participated in a traditional commitment ceremony. On May 30, 2009, Simmons gave birth to their son, Kenzo Lee Hounsou, reportedly named because Kenzo means 3 (Kimora''s third child). Hounsou is now a naturalized United States citizen and resides in Los Angeles. Â ', '1964-04-24 01:00:00.000', NULL, 'Djimon Hounsou', '/5Nsd55XnTVAaiyeMfKh0udl8Qyu.jpg', 'Cotonou, Benin', NULL, 938, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(113, 'From Wikipedia, the free encyclopedia. David Schofield is an English actor who born in Manchester, Lancashire in 1951. He has appeared in numerous television programmes and feature films during his career. Description above from the Wikipedia article David Schofield (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1970-01-01 01:00:02.000', NULL, 'David Schofield', '/6FdYsGTI85M5s5QDbFCogmQWsOR.jpg', 'Manchester, Lancashire, UK', NULL, 939, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(114, 'Shrapnel was born in Birmingham, Warwickshire, the son of Mary Lillian Myfanwy (nÃ©e Edwards) and journalist/author Norman Shrapnel.[1] As a stage actor, he was a member of Laurence Olivier''s Royal National Theatre company and the Royal Shakespeare Company and most recently appeared as Sir Oliver Surface in The School for Scandal (directed by Deborah Warner) at the Barbican Centre in 2011.  He has also appeared extensively in film and on television in roles in Elizabeth R, Z-Cars, Edward and Mrs. Simpson, 101 Dalmatians, Space: 1999, Inspector Morse, Coogan''s Run, Notting Hill and Foyle''s War. He presented an episode of the 1983 BBC television travel series Great Little Railways. He gave performances in three entries in the BBC Television Shakespeare plays and as Creon in the BBC''s 1984 productions of the Three Theban plays of Sophocles.  In America, he has starred in supporting roles as Senator Gaius in Gladiator, Nestor in Troy and Pompey in the second episode of Ancient Rome: The Rise and Fall of an Empire. He also played the Jail Warden in the 10th Kingdom, an epic fantasy miniseries.  He has the rare achievement of appearing in two episodes of Midsomer Murders as two different characters, in Death in Chorus and Written in Blood. Shrapnel appeared in an episode of Jonathan Creek as Professor Lance Graumann in the episode The Omega Man. He appears in Chemical Wedding alongside Simon Callow, telling the tale of the resurrection of occultist Aleister Crowley.  Shrapnel also has experience in the field of BBC radio drama through such characters as Colin Dexter''s Inspector Morse and William Gibson''s Neuromancer.  He is the son-in-law of Deborah Kerr through his 1975 marriage to her younger daughter Francesca Ann Bartley. They have three sons, the actors Lex Shrapnel (b.1979), Tom Shrapnel (b.1981) and the writer Joe Shrapnel (b.1976). They live in Highbury, north London.', '1942-04-27 02:00:00.000', NULL, 'John Shrapnel', '/nDIK01IoVNx7cfYOrKqGugItqO9.jpg', 'Birmingham, West Midlands, England, UK', NULL, 940, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(115, 'He co-starred as Quintus in Ridley Scott''s Gladiator (2000), the Dreamworks-Universal movie and winner of five Oscars, including Best Picture, co-starring Russell Crowe, Joaquin Phoenix, Connie Nielsen, Richard Harris, Derek Jacobi, and Oliver Reed. Three of Tomas Arana''s more recent films are: La volpe a tre zampe (2005), directed by Sandro Dionisio, a Teatri Uniti (Angelo Curti)/Cattelya Production that co-stars Miranda Otto, Angela Luce, and Nadja Uhl; Outpatient (2002), directed by Alec Carlin, with Justin Kirk and Catherine Kellner and the Jean-Claude Van Damme action film, Derailed (2002), directed by Bob Misiorowski. He was in Chimera (2001), directed by Pappi Corsicato, with Iaia Forte and Tommaso Ragno. He has appeared in more than 40 films, ranging from large budget Hollywood Studio pictures to Independent films in both the U.S. and Europe. His studio pictures include L.A. Confidential (1997) (as Bruening, a rogue cop), The Bodyguard (1992) (as Portman, Kevin Costner''s antagonist and Whitney Houston''s assassin), The Hunt for Red October (1990) (as Loginov, the Russian Saboteur), Tombstone (1993), and First Kid (1996). He played Lazarus in Martin Scorsese''s controversial The Last Temptation of Christ (1988). He was also featured in the Sundance-developed Wildflowers (1999), an independent film by Melissa Painter starring Clea DuVall and Daryl Hannah. Arana has played leading and supporting roles in over 30 European productions including films by directors such as Lina WertmÃ¼ller, Liliana Cavani, Carlo Verdone, Michele Soavi and with one of Japan''s most successful directors: Koreyoshi Kurahara in the Toho production See You (1988). In theatre, Arana was the producer as well as a leading actor in the internationally acclaimed Theatre Company Falso Movimento, based in Naples, Italy. Under Arana and the artistic director Mario Martone (now a major Italian Film Director), Falso Movimento won many awards including Best Play of the Year, Best Set Design and the prestigious Mondello Prize. The company toured worldwide for more than nine years at major International Festivals including London, Frankfurt, New York, Los Angeles, Madrid, Barcelona, Copenhagen, Stockholm, Jerusalem, and others. Tomas Arana grew up in San Francisco and studied classical theatre at its prestigious American Conservatory Theatre, afterwards relocating to New York and acting in off-Broadway productions. He then hitchhiked throughout Europe and ended up living in Naples, Italy, where he worked in the Lucio Amelio Art Gallery, working with such artists as Warhol, Rauschenberg, Beuys, Richter, Longobardi, Clemente, Gilbert &amp; George, etc. Andy Warhol painted his portrait, which is now part of his extensive art collection. He has both U.S. and Italian citizenship. He is married and has two sons. IMDb Mini Biography By: anonymous', '1955-04-03 01:00:00.000', NULL, 'Tomas Arana', '/sx8tDGA7e7d5oDYpQwaydmGcc93.jpg', 'Auburn - California - USA', NULL, 941, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(116, '', '1959-01-12 01:00:00.000', NULL, 'Ralf Moeller', '/hkeBpMT7UAPTARD6fPsG10Ob5Cr.jpg', 'Recklinghausen, Germany', NULL, 942, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(117, 'Tommy Flanagan (born 3 July 1965) is a Scottish film actor. Flanagan was born in Glasgow, Scotland, the 3rd of five children. Flanagan first television roles were in Screen One, 1992 and Taggart in 1993. Flanagan worked in Carlyle''s Raindog Theatre for three years before being cast in Braveheart (1995). He has had roles in Face/Off, The Game, Sunset Strip, Gladiator, Alien vs. Predator, Sin City, Smokin'' Aces, Smokin'' Aces 2: Assassins'' Ball, When a Stranger Calls, All About the Benjamins, The Last Drop and the mini-series "Attila." Flanagan also portrayed arms dealer Gabriel Schecter in the first episode of 24''s seventh season. Flanagan appeared in the episode "Headlock" of Lie To Me, aired in the U.S. on Monday 2 August, 2010. He is currently a regular cast member on Sons of Anarchy, in which he plays outlaw biker Filip "Chibs" Telford. His distinctive facial scars are a result of a mugging. Description above from the Wikipedia article Tommy Flanagan, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1965-07-03 01:00:00.000', NULL, 'Tommy Flanagan', '/8ldG9cMtj8oTgRzDrQNSYnsVC8u.jpg', 'Glasgow, Ecosse, Royaume-Uni', NULL, 2478, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(118, 'â€‹From Wikipedia, the free encyclopedia. Â  Spencer Treat Clark (born September 24, 1987) is an American actor who has appeared in several films, including Gladiator, Mystic River, and Unbreakable. Description above from the Wikipedia article Spencer Treat Clark, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1987-09-24 02:00:00.000', NULL, 'Spencer Treat Clark', '/pE1tWrcDDlOYw3TjnbsJ1PU4pZq.jpg', 'New York City, New York, United States', NULL, 4012, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(119, 'David Edward Leslie Hemmings (18 November 1941 â€“ 3 December 2003) was an English film, theatre and television actor as well as a film and television director and producer. He is noted for his role as the photographer in the drama mystery-thriller film Blowup (1966), directed by Michelangelo Antonioni. Early in his career, Hemmings was a boy soprano appearing in operatic roles. In his later acting career, he was known for his distinctive eyebrows and gravelly voice. Description above from the Wikipedia article David Hemmings, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1941-11-18 02:00:00.000', NULL, 'David Hemmings', '/quHWbAu3NLLZ5NOSJNfrlkks7lV.jpg', 'Guildford, Surrey, England, UK', NULL, 15196, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(120, 'Scott was born in South Shields, Tyne and Wear, England, the son of Elizabeth and Colonel Francis Percy Scott. He was raised in an Army family, meaning that for most of his early life, his father â€” an officer in the Royal Engineers â€” was absent. Ridley''s older brother, Frank, joined the Merchant Navy when he was still young and the pair had little contact. During this time the family moved around, living in (among other areas) Cumbria, Wales and Germany. He has a younger brother, Tony, also a film director. After the Second World War, the Scott family moved back to their native north-east England, eventually settling in Teesside (whose industrial landscape would later inspire similar scenes in Blade Runner). He enjoyed watching films, and his favourites include Lawrence of Arabia, Citizen Kane and Seven Samurai. Scott studied in Teesside from 1954 to 1958, at Grangefield Grammar School and later in West Hartlepool College of Art, graduating with a Diploma in Design. He progressed to an M.A. in graphic design at the Royal College of Art from 1960 to 1962. At the RCA he contributed to the college magazine, ARK and helped to establish its film department. For his final show, he made a black and white short film, Boy and Bicycle, starring his younger brother, Tony Scott, and his father. The film''s main visual elements would become features of Scott''s later work; it was issued on the ''Extras'' section of The Duellists DVD. After graduation in 1963, he secured a job as a trainee set designer with the BBC, leading to work on the popular television police series Z-Cars and the science fiction series Out of the Unknown. Scott was an admirer of Stanley Kubrick early in his development as a director. For his entry to the BBC traineeship, Scott remade Paths of Glory as a short film. He was assigned to design the second Doctor Who serial, The Daleks, which would have entailed realising the famous alien creatures. However, shortly before Scott was due to start work, a schedule conflict meant that he was replaced on the serial by Raymond Cusick. At the BBC, Scott was placed into a director training programme and, before he left the corporation, had directed episodes of Z-Cars, its spin-off, Softly, Softly, and adventure series Adam Adamant Lives! In 1968, Ridley and Tony Scott founded Ridley Scott Associates (RSA), a film and commercial production company.Five members of the Scott family are directors, all working for RSA. Brother Tony has been a successful film director for more than two decades; sons, Jake and Luke are both acclaimed commercials directors as is his daughter, Jordan Scott. Jake and Jordan both work from Los Angeles and Luke is based in London. In 1995, Shepperton Studios was purchased by a consortium headed by Ridley and Tony Scott, which extensively renovated the studios while also expanding and improving its grounds. Â ', '1937-11-30 01:00:00.000', NULL, 'Ridley Scott', '/bG5Oa1H6Fevil5QzzpzYF21NIQq.jpg', 'South Shields, County Durham, England, UK', NULL, 578, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(121, 'Kevin Spacey Fowler (born July 26, 1959), better known by his stage name Kevin Spacey, is an American actor of screen and stage, film director, producer, screenwriter and singer who has resided in the United Kingdom since 2003. He began his career as a stage actor during the 1980s before obtaining supporting roles in film and television. He gained critical acclaim in the early 1990s that culminated in his first Academy Award for Best Supporting Actor for the neo-noir crime thriller The Usual Suspects (1995), and an Academy Award for Best Actor for midlife crisis-themed drama American Beauty (1999). His other starring roles have included the comedy-drama film Swimming with Sharks (1994), psychological thriller Seven (1995), the neo-noir crime film L.A. Confidential (1997), the drama Pay It Forward (2000), the science fiction-mystery film K-PAX (2001), and the role of Lex Luthor in the superhero film Superman Returns (2006). Description above from the Wikipedia article Kevin Spacey, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1959-07-26 01:00:00.000', NULL, 'Kevin Spacey', '/jbtmA7ip3NqDU9l7B8mJs5fwEuQ.jpg', 'South Orange, New Jersey, USA', NULL, 1979, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(122, 'Annette Francine Bening (born May 29, 1958) is an American actress. Bening is a four-time Oscar nominee for her roles in The Grifters, American Beauty, Being Julia and The Kids Are All Right, winning Golden Globe Awards for the latter two films. Bening is married to actor Warren Beatty, with whom she has four children.', '1958-05-29 01:00:00.000', NULL, 'Annette Bening', '/47y1KLDYb2QlbVGVHJHLs4MW1YP.jpg', 'Topeka, Kansas, United States', NULL, 516, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(123, 'Thora Birch (born March 11, 1982) is an American actress. She was a child actor in the 1990s, starring in movies such as All I Want for Christmas (1991), Patriot Games (1992), Hocus Pocus (1993), Now and Then (1995), and Alaska (1996). She came to prominence in 1999 after earning worldwide attention and praise for her performance in American Beauty. She then starred in the well received film Ghost World (2001), which earned her a Golden Globe nomination. Description above from the Wikipedia article Thora Birch, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1982-03-11 01:00:00.000', NULL, 'Thora Birch', '/jxtp9prkQgFmj0ZRvi1kcnnqaWb.jpg', 'Los Angeles, California, USA', NULL, 2155, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(124, 'Wesley Cook "Wes" BentleyÂ (born September 4, 1978)Â is anÂ AmericanÂ film actor known for his roles as Ricky Fitts inÂ American BeautyÂ (1999) and Seneca Crane inÂ The Hunger GamesÂ (2012).Â Bentley was one of four subjects in the documentaryÂ My Big BreakÂ (2009), which covered his fame afterÂ American BeautyÂ and struggles with substance abuse. Rebuilding his career, he starred in the premier ofÂ Venus in FurÂ by David Ives in the off-Broadway production in 2010, whose run was extended. Description above from the Wikipedia article Wes Bentley, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1978-09-04 01:00:00.000', NULL, 'Wes Bentley', '/k5VP6CYI5C7p6HUjHfhmUYQ69xP.jpg', 'Jonesboro, Arkansas, USA', NULL, 8210, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(125, 'Mena Alexandra Suvari (born February 13, 1979) is an American actress, fashion designer, and model. Shortly after beginning her career as a model, she soon transitioned into acting after appearing in guest roles on 1990''s television shows such as Boy Meets World and High Incident. She made her film debut in the 1997 drama film Nowhere. She made the transition to major roles with her performances in American Beauty, for which she was nominated for a BAFTA Award, and American Pie, both of which earned her wider attention. Since then, she appeared in Loser (2000), with her American Pie co-star, Jason Biggs, and later played the main character in the comedy film Sugar &amp; Spice (2001). She had appearances in the 2002 independent drama Spun, and the 2004 thriller feature Trauma. She also appeared in the HBO''s drama series Six Feet Under in 2004, she received a nomination as a member of the Outstanding Cast at the 2005 Screen Actors Guild Awards. In 2008, she was cast in a string of films, including Day of the Dead, The Mysteries of Pittsburgh, and the film adaptation of The Garden of Eden. Suvari is a model for LancÃ´me cosmetics and print ads for LancÃ´me Paris AdaptÃ®ve, and has been featured in several fashion blogs and magazines such as Vogue. She is a long-time supporter and activist for the esteemed African relief organization, the African Medical and Research Foundation. She is also active in female empowerment issues, and is involved with charities whose cause is breast cancer, and "End Violence Against Women" campaign. Description above from the Wikipedia article Mena Suvari, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1979-02-13 01:00:00.000', NULL, 'Mena Suvari', '/5Dr8dXoZhBa5J9hk1cODiusKo18.jpg', 'Newport - Rhode Island - USA', NULL, 8211, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(126, 'Christopher W. "Chris" Cooper (born July 9, 1951) is an American film actor. He became well known in the late 1990s, having appeared in supporting performances in several major Hollywood films, including The Bourne Identity, American Beauty, Capote, The Town, The Kingdom, Syriana, October Sky, Seabiscuit, and Adaptation, for which he won both the Academy Award and Golden Globe Award for Best Supporting Actor. Description above from the Wikipedia article Chris Cooper (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia', '1951-07-09 01:00:00.000', NULL, 'Chris Cooper', '/4ldKtvnCpSaMRAw2DWQcOkeb3Ig.jpg', 'Kansas City, Missouri, USA', NULL, 2955, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(127, 'â€‹From Wikipedia, the free encyclopedia. Scott Stewart Bakula (born October 9, 1954) is an American actor, known for his role as Sam Beckett in the television series Quantum Leap, for which he won the Golden Globe Award for Best Actor â€“ Television Series Drama in 1991 and was nominated for four Emmy Awards. He also had a prominent role as Captain Jonathan Archer in Star Trek: Enterprise. Bakula also guest starred in seasons two and three of NBC''s Chuck as the title character''s father Stephen Bartowski. Bakula can currently be seen on the TNT series Men of a Certain Age, as Terry.', '1954-10-09 01:00:00.000', NULL, 'Scott Bakula', '/nnF7X8FIl4z8P5n57jTTbj5CkB5.jpg', 'St. Louis - Missouri - USA', NULL, 2154, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(128, 'From Wikipedia, the free encyclopedia. Peter Killian Gallagher (born August 19, 1955 height 5'' 10" (1,78 m)) is an American actor, musician and writer. Since 1980, Gallagher has played many roles in numerous Hollywood films. He starred as Sandy Cohen in the television drama series The O.C. from 2003 to 2007. He currently appears in a recurring role on the USA Network drama Covert Affairs as CIA Clandestine Services Director Arthur Campbell. Description above from the Wikipedia article Peter Gallagher, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1955-08-19 01:00:00.000', NULL, 'Peter Gallagher', '/k2n1jMu2fYicFS5jBi1DzCXkeMd.jpg', 'New York City, New York, USA', NULL, 8212, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(129, 'Allison Janney is an American actress born in Dayton, Ohio, who studied at Kenyon College where she studied under Paul Newman. Â Janney pursued acting partially due to Newmanâ€™s encouragement, going on to study drama at the Neighborhood Playhouse and the Royal Academy of Dramatic Art. Â Â  Janney is best known for her role as White House Press Secretary (and later Chief of Staff) C.J. Cregg on the television series The West Wing. Â Janneyâ€™s portrayal of Cregg earned her multiple awards, including four Primetime Emmy Awards and seven Screen Actors Guild Awards, among many others. Â  Prior to West Wing-fame, Janney performed in numerous American films and soap operas, including American Beauty, As The World Turns, and 10 Things I Hate About You. Â Following her considerable television success, Janney has gone on to star in numerous critically acclaimed movies and television programs. She remains active in theatre and often works with fellow West Wing alums. Janney currently lends her voice and talent to television and radio through notable guest spots and commercial advertising. Â ', '1959-11-19 01:00:00.000', NULL, 'Allison Janney', '/Av9RQI1ihzYWpQeb8LrO8L38e4U.jpg', 'Dayton - Ohio - USA', NULL, 19, NULL);
