INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(135, 'Samuel Alexander "Sam" Mendes, CBE (born 1 August 1965) is an English stage and film director. He has won two Laurence Olivier Awards for his London stage productions The Glass Menagerie and Company in 1996, and Twelfth Night and Uncle Vanya in 2003. He also received a Tony Award nomination for Best Direction of a Musical for the Broadway revival of Cabaret in 1998. His debut film American Beauty (1999) earned him an Academy Award for Best Director. Description above from the Wikipedia article Sam Mendes, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1965-08-01 01:00:00.000', NULL, 'Sam Mendes', '/9ZHO6I45789LzOGjAV6qRRoZ4X.jpg', 'Reading, Berkshire, England, UK', NULL, 39, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(136, 'Mel Colm-Cille Gerard Gibson, AO (born January 3, 1956) is an actor, film director, producer and screenwriter. Born in Peekskill, New York, Gibson moved with his parents to Sydney, Australia when he was 12 years old and later studied acting at the Australian National Institute of Dramatic Art. After appearing in the Mad Max and Lethal Weapon series, Gibson went on to direct and star in the Academy Award-winning Braveheart. In 2004, he directed and produced The Passion of the Christ, a controversial, yet successful, film portraying the last hours in the life of Jesus Christ. Outside his career, remarks by Gibson have generated accusations of homophobia, antisemitism, racism, and misogyny; he has previously attributed the statements to his alcoholism. Description from Wikipedia', '1956-01-03 01:00:00.000', NULL, 'Mel Gibson', '/6VGgL0bBvPIJ9vDOyyGf5nK2zL4.jpg', 'Peekskill, New York, USA', NULL, 2461, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(137, 'Catherine McCormack (born 1 January 1972) is an English actress, known for her stage acting as well as her screen performances in films such as Braveheart, Spy Game and Dangerous Beauty. Description above from the Wikipedia article Catherine McCormack, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1972-01-01 01:00:00.000', NULL, 'Catherine McCormack', '/a8Jszh3rHQ2T4u1VyE4lXrb0uDI.jpg', 'Alton, Hampshire, England, UK', NULL, 2462, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(138, 'From Wikipedia, the free encyclopedia. Sophie Marceau (born 17 November 1966, height 5'' 7Â¾" (1,72 m)) is a French actress, who has appeared in 35 films. During her teens, Marceau achieved popularity with her debut films La Boum (1980) and La Boum 2 (1982), for which she received a CÃ©sar Award for Most Promising Actress. In addition to her French-language films, she has worked in international films such as Braveheart (1995), and played the main antagonist, Elektra King, in The World Is Not Enough (1999). Early life Sophie Marceau was born 17 November 1966 in Paris, the second child of Simone (nÃ©e Morisset), a shop assistant, and BenoÃ®t Maupu, a truck driver. Her parents divorced when she was nine years old', '1966-11-17 01:00:00.000', NULL, 'Sophie Marceau', '/yxgcvmZx2e78DEphyT6R2THJoJZ.jpg', 'Paris - France', NULL, 1957, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(139, 'From Wikipedia, the free encyclopedia Patrick Joseph McGoohan (March 19, 1928 â€“ January 13, 2009) was an American-born actor, raised in Ireland and England, with an extensive stage and film career, most notably in the 1960s television series Danger Man (renamed Secret Agent when exported to the US), and The Prisoner. McGoohan wrote and directed several episodes of The Prisoner himself, occasionally using the pseudonyms Joseph Serf and Paddy Fitz. He subsequently appeared in several Columbo episodes, winning the Emmy twice, David Cronenberg''s Scanners, and in Mel Gibson''s Braveheart as King Edward I. Description above from the Wikipedia article Patrick McGoohan, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1928-03-19 01:00:00.000', NULL, 'Patrick McGoohan', '/5lDTsSa2iMZDdiAOq9SMEq8bFGk.jpg', 'New York City, New York, USA', NULL, 2463, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(140, 'â€‹From Wikipedia, the free encyclopedia Angus Macfadyen (born 21 September 1963) is a Scottish actor. Angus Macfadyen was born in Glasgow and was brought up partly in Africa, France, the Philippines and Singapore. His father was a doctor in the World Health Organisation. He was once engaged to actress Catherine Zeta-Jones. Macfadyen attended the University of Edinburgh, and the Central School of Speech and Drama in London. He has played Orson Welles in Tim Robbins'' 1999 film, Cradle Will Rock, Philip in the BBC''s production of The Lost Language of Cranes, Dupont in Equilibrium, Robert the Bruce in 1995''s Braveheart and Jeff Denlon in the Saw series of films as well as real-life British actors as Peter Lawford (The Rat Pack) and Richard Burton (Liz: The Elizabeth Taylor Story). Description above from the Wikipedia article Angus Macfadyen, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1963-09-21 01:00:00.000', NULL, 'Angus Macfadyen', '/8j9zifCWRAyrHO2HhJ55HGPcu1N.jpg', ' Glasgow, Scotland, UK', NULL, 2464, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(141, 'Brendan Gleeson is an Irish actor. His best-known films include the Harry Potter films, Braveheart, Gangs of New York, 28 Days Later, and the role of Michael Collins in The Treaty. He won an Emmy award in 2009 for his portrayal of Winston Churchill in the film Into the Storm. Gleeson was born in Dublin, Ireland and has described himself as having been an avid reader as a child. After leaving school for a short while, he worked for two years in an office with a health board. He then graduated from University College Dublin and went on to Drama School in London at the Royal Academy of Dramatic Art (RADA). Just after completing the 3 Year Acting Drama Course at RADA, Gleeson built a very respectable CV at the Royal National Theatre, Shakespeare''s Globe Theatre, and the Royal Shakespeare Company in Stratford-upon-Avon. Gleeson became known for his tremedous stage presence, particularly while performing in such works of William Shakespeare as King Lear, Richard III, and Hamlet. Gleeson started his film career at the age of 34. He first came to prominence in Ireland for his role as Michael Collins in The Treaty a television film broadcast on RTÃ‰ One, and for which he won a Jacob''s Award in 1992. Gleeson has subsequently acted in more than 60 films including Braveheart, I Went Down, Michael Collins, Gangs of New York, Cold Mountain, 28 Days Later, Troy, Kingdom of Heaven, Lake Placid, Artificial Intelligence: AI and The Village. He won critical acclaim for his performance as Irish gangster Martin Cahill in John Boorman''s 1998 film The General. Gleeson lives in Malahide, County Dublin. He is a talented fiddle player, with an interest in Irish folklore. He can be found from time to time playing at traditional music seisiÃºins in Hughes'' pub in Chancery Street in Dublin 7. His brother, Barry Gleeson, is a well-known singer in An GÃ³ilÃ­n traditional singers'' club, and his son Domhnall is an actor. Gleeson is known for his love of football and recounts tales of attempting to get a clear radio reception so he could listen to how his team, Aston Villa, were faring on a Saturday.', '1955-03-29 01:00:00.000', NULL, 'Brendan Gleeson', '/4lvvmj2XtUgj2HlsnY8X0F2KQps.jpg', 'Dublin, Ireland', NULL, 2039, NULL);
