INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(148, 'From Wikipedia, the free encyclopedia. Sean Lawlor (January 25, 1954 â€“ October 10, 2009), was an Irish character actor and playwright. He was best known for his portrayal of Malcolm Wallace in Mel Gibson''s Oscar-winning epic, Braveheart. In addition, he also appeared in James Cameron''s Titanic and Jim Sheridan''s In the Name of the Father. Other recent roles include Martin O Toole in "On Broadway" and Earl Leofric in "1066". Irish television viewers will know him from his role in RTE''s 1980''s series, "Bracken" as well as parts in many Irish films. He produced plays for the stage include the one man play, "The Watchman", which he also wrote. As a stage actor his significant roles include Jap Kavanagh in "The Kings of the Kilburn High Road" for Waterford''s Red Kettle Theatre company with whom he worked with on numerous occasions. Description above from the Wikipedia article Sean Lawlor, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1954-01-25 01:00:00.000', NULL, 'Sean Lawlor', '/ehCSI4ZfmHRB59mZtrUs6xLo47I.jpg', 'Dublin, Ireland', NULL, 2472, NULL);
