INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(150, 'Robert Carlyle, OBE (born 14 April 1961) is a Scottish film and television actor. He is known for a variety of roles including those in Trainspotting, Hamish Macbeth, The Full Monty, The World Is Not Enough, Angela''s Ashes, The 51st State, and 28 Weeks Later. He also portrayed Doctor Nicholas Rush in Stargate Universe. Description above from the Wikipedia article Robert Carlyle, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1961-04-14 01:00:00.000', NULL, 'Robert Carlyle', '/ufW8k38p9bSVzVF8bRFIn31Ey6x.jpg', 'Glasgow, Scotland, UK', NULL, 18023, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(151, 'â€‹From Wikipedia, the free encyclopedia. LuÃ­s Ferreira (also known as Louis Ferreira or Justin Louis, sometimes spelled as Justin Lewis) is a Portuguese-born Canadian actor. Ferreira is best-known for his roles in Stargate Universe as Colonel Everett Young, serial killer Ray Prager in the first season of Durham County, and as FBI Assistant Director, John Pollock in Missing. Description above from the Wikipedia article Louis Ferreira, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1967-02-20 01:00:00.000', NULL, 'Louis Ferreira', '/mqJglT0g3tRMg5cNeJ7C6vdP4E.jpg', 'Terceira Island, Azores, Portugal', NULL, 51036, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(152, 'Brian J. Smith (born October 12, 1981) is an American actor who is known for his role as Trey in the 2006 independent film Hate Crime and as series regular Lt. Matthew Scott in the military science fiction television series, Stargate Universe. Smith is a native of Allen, Texas. After studying at the Quad C Theatre program at the Collin County Community College in Plano, Texas, Smith graduated from the Juilliard School Drama Division''s four-year acting program in New York City. In 2005, he portrayed Trey, a gay man facing intolerance from the son of a fundamentalist preacher, in Hate Crime, an independent film featured at multiple gay and lesbian film festivals around the United States. Smith also portrayed roles in two more independent films, Red Hook and The War Boys. In 2008, he appeared on Broadway in the play Come Back, Little Sheba as the character Turk. Smith was cast as Lieutenant Matthew Scott, a lead role in the 2009 Stargate television series, Stargate Universe, until its cancellation in 2010. Description above from the Wikipedia article Brian J. Smith, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1981-10-12 01:00:00.000', NULL, 'Brian J. Smith', '/AGUcDMz6VBd2qKwJhEf2oD8jOt.jpg', 'Dallas - Texas - USA', NULL, 22541, NULL);
