INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(154, 'From Wikipedia, the free encyclopedia. David Blue (born  January 17, 1982) is an American actor, writer, producer and director.  He is best known for his portrayal of Cliff St. Paul on Ugly Betty and  Eli Wallace on the Syfy series Stargate Universe.', '1982-01-17 01:00:00.000', NULL, 'David Blue', '/pRjWSbwf4huBSYj9FcOCwSQtlva.jpg', 'Long Island - New York - USA', NULL, 1215142, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(155, 'From Wikipedia, the free encyclopedia. Alaina Huffman (born April 17, 1980) is a Canadian film and television actress, also known professionally as Alaina Kalanj (her birth name). She may be best-known for her role on the Canadian television series Painkiller Jane, in which she played Maureen Bowers. Most recently she played Dinah Lance/Black Canary on Smallville. She was a regular cast member in the TV series Stargate Universe. Description above from the Wikipedia article Alaina Huffman, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1980-04-17 02:00:00.000', NULL, 'Alaina Huffman', '/4MCSW1drAdiPLmNc1F6uU6vWsxy.jpg', 'Vancouver, British Columbia, Canada', NULL, 169725, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(156, 'From Wikipedia, the free encyclopedia. Jamil Walker Smith (born August 20, 1982) is an American actor. His best known role is as the voice of Gerald, a fourth grader and Arnold''s best friend in the Nickelodeon TV series Hey Arnold!. He also appeared on various shows like Sister, Sister, Girlfriends, Bones, The X-Files, and The Bernie Mac Show. He is an actor by trade and writes, acts and directs his own short film projects. He recently portrayed Master Sergeant Ronald Greer in the third series of the Stargate franchise, Stargate Universe. Description above from the Wikipedia article Jamil Walker Smith, licensed under CC-BY-SA, full list of contributors on Wikipedia.â€‹', '1982-08-20 02:00:00.000', NULL, 'Jamil Walker Smith', '/juy9QMISx6uXzRq4NKSnFRXShOr.jpg', 'New York City, New York, U.S.', NULL, 82529, NULL);
