INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(158, 'Robert C. Cooper is a Canadian writer and producer best known for his work in the Stargate franchise. He was formerly an executive producer of Stargate SG-1 and Stargate Atlantis until both series conclusion and currently holds the same title on the third Stargate series Stargate Universe. He also co-created both Stargate Atlantis and Stargate Universe with Brad Wright. Cooper has written and produced many episodes of Stargate SG-1, Stargate Atlantis and Stargate Universe as well as directing a number of episodes. Description above from the Wikipedia article Robert C. Cooper, licensed under CC-BY-SA, full list of contributors on Wikipedia.â€‹', '1968-10-14 01:00:00.000', NULL, 'Robert C. Cooper', '/5IefO2aEDml9gNoITquVF0eth4L.jpg', 'Toronto, Ontario, Canada', NULL, 27745, NULL);
