INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(162, 'Wes Chatham was born October 11, 1978 and grew up in North Georgia. Wes''s parents divorced when he was two and he spent most of his childhood with his Mom, sister and brother. On a whim, Wes''s mother took his sister to a audition for a Tide commercial in Savannah, Georgia and brought Wes along. While waiting for his sister in the lobby, the casting director discovered Wes and at the age of five, he was offered a national campaign for Tide.  At the age of thirteen, Wes moved in with his father and without a lot of supervision and as a restless and rebellious teen, he was kicked out of high school and sent to the Gift Center in Lawrencville, GA to finish school. The Gift Center was a second chance school for troubled youth, offering very small classes and a higher standard of education than public school. While attending classes, a professional theater company out of Atlanta started a mentoring program with the school and Wes was chosen to write a play that was later performed by his classmates. It was from this experience that Wes found his passion for the arts.  After graduating high school, Wes joined the military. He worked as an aviation firefighter on the flight deck of the USS Essex, working in crash and salvage for four years. Wes'' break into acting came just three months before his tour was finished when Denzel Washington chose his ship to shoot the movie Antwone Fisher. While searching for some authentic military guys for the movie, Wes was discovered by casting director Robi Reed and given his first movie making experience. That''s when he decided he wanted to pursue his life long dream of acting. Following Antwone Fisher, Robi convinced Wes to make the move to Hollywood and shortly thereafter cast him in his first series regular role on Showtime''s Barbershop.  Wes really started to get attention when Paul Haggis cast him along side Tommy Lee Jones as Corporal Steve Penning in In the Valley of Elah. Tommy Lee Jones was nominated for the Academy Award for Best Actor for his role.  In 2009, Wes would go on to work with Oliver Stone in W. as Frank Benedict, George W''s Fraternity brother. The following year, Wes landed another series regular role on CBS'' hit TV show The Unit as new Unit team member Staff Sergeant Sam McBride aka Whiplash, working with David Mamet and Shawn Ryan. Wes also starred as Brian Danielson in Brett Simmons'' Husk.  In 2011, Wes''s was a part of the SAG Award Winning Ensemble Cast in DreamWork''s The Help starring Emma Stone, Viola Davis, Octavia Spencer, Jessica Chastain, Allison Janney, Mike Vogel and Sissy Spacek. Cast in the role of Carleton Phelan, Wes played Emma Stone''s brother in the film. In February 2012, the film received four Academy Award nominations including Best Picture, Best Actress for Viola Davis, Best Supporting Actress for Jessica Chastain and a win for Best Supporting Actress for Octavia Spencer.  In 2012, Wes landed his first title role in Joel Silver''s The Philly Kid. A fan of mixed martial arts, Wes really dived into the character of Dillion McGwire, performing all of his own stunts. The film debuted in theaters May of 2012. Following The Philly Kid, Wes starred in This Thing With Sarah, which was recently accepted to the San Diego Film Festival.  In 2013 Wes wrapped two studio films, Broken Horses and The Town That Dreaded Sundown. Both are due in theaters late 2013 early 2014.', '1978-10-11 01:00:00.000', NULL, 'Wes Chatham', '/nwQdBEKxQ7KhyP1hQvLBZe6AXN2.jpg', 'Georgia, USA', NULL, 51682, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(163, 'Shohreh Aghdashloo ( born May 11, 1952) is an Iranian American actress. After establishing a theatre and film career in Iran, Aghdashloo moved to England during the Iranian Revolution in 1979, and subsequently became a citizen of the United States. After several years playing supporting roles in television and film, her performance in House of Sand and Fog (2003) brought her several film critics'' awards and a nomination for an Academy Award for Best Supporting Actress. She has continued to play supporting and character roles in film and television and won an Emmy Award for her work in the television drama House of Saddam (2008). Description above from the Wikipedia Shohreh Aghdashloo, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1952-05-11 01:00:00.000', NULL, 'Shohreh Aghdashloo', '/c4eX7r2OLvQWifqvStGfjCaOCn2.jpg', 'Tehran, Iran', NULL, 21041, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(164, 'Thomas Jane (born Thomas Elliott III; February 22, 1969) is an American actor, known for his roles in the 1999 film Deep Blue Sea, the 2001 TV movie 61*, the 2004 film The Punisher and the 2007 Stephen King adaptation The Mist. He currently stars in the HBO comedy-drama series Hung. Description above from the Wikipedia article Thomas Jane, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1969-02-22 01:00:00.000', NULL, 'Thomas Jane', '/3XraWZoaXGkIeia44qcrlzudq4v.jpg', 'Baltimore, Maryland, USA', NULL, 11155, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(165, 'Frankie Adams is a New Zealand actress and amateur boxer of Samoan heritage. She is 6 ft (1.8 m) tall. Adams'' first role, aged 16, was that of Ula Levi in the soap opera Shortland Street. She has also had roles in the television series Wentworth and in the film 1000 Ropes. As a boxer, Adams has participated in a Fight For Life charity boxing event', NULL, NULL, 'Frankie Adams', '/cmOPcI8KXxeab62PnxMtYpRO8ug.jpg', 'Auckland City, Auckland, New Zealand', NULL, 1753341, NULL);
