INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(167, 'Kevin McKidd (born 9 August 1973) is a Scottish television and film actor and director. He is known for his prominent television roles, including his performances as Lucius Vorenus in Rome, as Poseidon in Percy Jackson &amp; the Olympians: The Lightning Thief, and as Dr. Owen Hunt in Grey''s Anatomy. He has also appeared in films such as Trainspotting, Bedrooms and Hallways, Kingdom of Heaven, The Last Legion, Hannibal Rising, The Acid House, Made of Honor and had the lead role in the cult-classic British horror film Dog Soldiers. McKidd has done voice work and voiced the character of Jezz Torrent, flame haired lead singer of the fictional Scottish hard rock band Love Fist in the video games "Grand Theft Auto: Vice City". He also voiced Captain "Soap" MacTavish in Call of Duty: Modern Warfare 2. Description above from the Wikipedia article Kevin McKidd, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1973-08-09 01:00:00.000', NULL, 'Kevin McKidd', '/vcHsz2rxQxw7AvCKzvaWmyugF1V.jpg', 'Elgin, Moray, Scotland, UK', NULL, 9013, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(168, 'Ray Stevenson was born in Lisburn, Northern Ireland on 25 May 1964. He is a film, TV and stage actor. He moved with his family to Lemington, Newcastle-Upon-Tyne, England in 1972 at the age of eight, and later to Cramlington, Northumberland, where he was raised. The second of three sons of a Royal Air Force pilot father and an Irish mother, As a child he dreamed to become an actor, but he also thought that dream was impossible. So he pursued his other love, art, and went to art school instead. He was an interior designer with an architectural firm in London when he at 25 decided to try out acting. Eventually he attended Bristol Old Vic Theatre School, graduating at the age of 29. At the beginning of 90s, he began his career on films. He did a few TV films, one of them is The Return of the Native (1994), where he appeared opposite Clive Owen, Catherine Zeta-Jones and Steven Mackintosh. He also filmed The Theory of Flight (1998) Greenwich Mean Time (1999), Green-Eyed Monster (2001) (TV) and a lot of TV guest roles in series. Finally, he made a international breakout with King Arthur (2004), as quiet, but loyal knight Dagonet, again with Clive Owen (who played Arthur), Keira Knightley, Ioan Gruffudd, Mads Mikkelsen, Ray Winstone and Stellan Skarsgard. After a few more TV films, Stevenson''s popularity stared to rise by each film. But, the real fame comes with HBO''s "Rome" (2005 - 2007), as funny, but heroically fearless legionary Titus Pullo, opposite Kevin McKidd. Another two well-known roles were in action horror Outpost (2008) and as comic book dark hero The Punisher / Frank Castle in extremely violent Punisher: War Zone (2008), opposite Dominic West (Jigsaw), Doug Hutchison, Colin Salmon, Wayne Knight (Microchip), Dash Mihok (Det. Marin Soap) and Julie Benz. To mention that Stevenson also worked on stage. He played the part of Christ in the York Mystery Plays in 2000 at York Minster. In 2001 he took the part of Roger in the play Mouth to Mouth by Kevin Elyot, at the Albery Theatre in London with Lindsay Duncan and Michael Maloney. His most well-known part is perhaps that of the Cardinal in The Duchess of Malfi by John Webster with Janet McTeer at the Royal National Theatre in 2003. Stevenson and his girlfriend Elisabetta Carccia have a son Sebastiano Derek Stevenson, who was born in 2007. Besides acting, he loves art and has a passion for water color painting.', '1964-05-24 01:00:00.000', NULL, 'Ray Stevenson', '/A475wJK3B8Nr7eiFZKxEHA4XSIj.jpg', 'Lisburn - Northern Ireland - UK', NULL, 56614, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(169, 'Ciaran Hinds was born in Belfast, Northern Ireland on February 9, 1953. He was one of five children and the only son. His father was a doctor who hoped to have Ciaran follow in his footsteps, but that was not to be. It was his mother Moya, an amateur actress, who was the real influence behind his decision to become an actor. Though he did enroll in Law at Queens'' University of Belfast, he left that in order to train in acting at RADA. He began his stage career at the Glasgow Citizens'' Theatre as a pantomime horse in the production of "Cinderella". Staying with the company for several years, he starred in a number of productions, including playing the lead roles in "Arsenic and Old Lace" and "Faust". His stage career has included working with The Field Day Company and a number of world tours. He has starred in a number of productions with the Royal Shakespeare Company, including a world tour in the title role of "Richard III". Hinds'' film career began in 1981 in the movie Excalibur (1981), which boasted a cast rich in talented actors including Liam Neeson, Gabriel Byrne and Patrick Stewart. In-between his movie work, he''s amassed a large number of television credits. Playing such classic characters as "Mr. Rochester" in Jane Eyre (1997) (TV), and "Captain Wentworth" in Persuasion (1995) has increased his popularity and most definitely given him much increased recognition. As for his personal life, you won''t be likely to see his name in the weekly tabloids. He likes to keep his private life private. It is known that he is in a long-term, committed relationship with a French-Vietnamese actress named HÃ©lÃ¨ne Patarot and they have a daughter together and live in Paris. He is in very high demand and his reputation as a quality, professional actor is sure to keep him busy for as long as he chooses. IMDb Mini Biography By: Sheryl Reeder', '1953-02-09 01:00:00.000', NULL, 'CiarÃ¡n Hinds', '/2HJ3egmUeZFVHLkgGuKbM0lhgx4.jpg', 'Belfast, Northern Ireland, UK', NULL, 8785, NULL);
