INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(184, 'From Wikipedia, the free encyclopedia. Ellen Anna Muth (born March 6, 1981) is an American actress, known for her role as George Lass in Showtime''s series Dead Like Me. Muth is a member of Intertel and Mensa. Description above from the Wikipedia article Â Ellen Muth, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1981-03-06 01:00:00.000', NULL, 'Ellen Muth', '/1U1qdqyKCNbmi6r8HdN3ahur1zp.jpg', 'Milford, Connecticut, U.S.A.', NULL, 1218072, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(185, 'From Wikipedia, the free encyclopedia. Mandel Bruce "Mandy" Patinkin (November 30, 1952, Chicago, Illinois) is an American actor of stage and screen and a tenor vocalist. Patinkin is a noted interpreter of the music of Stephen Sondheim and is known for his work in musical theatre, originating iconic roles such as Georges Seurat in Sunday in the Park with George, Archibald Craven in The Secret Garden and Burrs in The Wild Party. He has also appeared in television series such as Chicago Hope, Dead Like Me and the first two seasons of Criminal Minds. His most noted film role was as Inigo Montoya in The Princess Bride. Other noteworthy film roles include Alien Nation, Yentl, Men With Guns, Run Ronnie Run, Dick Tracy, and The Adventures of Elmo in Grouchland. Description above from the Wikipedia article Mandy Patinkin, licensed under CC-BY-SA, full list of contributors on Wikipediaâ€‹', '1952-11-30 01:00:00.000', NULL, 'Mandy Patinkin', '/svluxQUvNBhAVbICjtzHNQ1nRDY.jpg', 'Chicago, Illinois, USA', NULL, 25503, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(186, 'From Wikipedia, the free encyclopedia. Laura Elizabeth Harris (born November 20, 1976) is a Canadian actress. Description above from the Wikipedia article Laura Harris, licensed under BY-SA, full list of contributors on Wikipedia.', '1976-11-20 01:00:00.000', NULL, 'Laura Harris', '/xanFPpDB4bGr1m6J0qV0j5jFks8.jpg', 'Vancouver, British Columbia, Canada', NULL, 25872, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(187, 'From Wikipedia, the free encyclopedia. Daniel James Callum Blue (born 19 August 1977) is an English film and television actor known for his roles in the Showtime series The Tudors, Dead Like Me as well as for his role as Zod in the American television series Smallville (both shows also have roles for actress Christine Willes) and British TV series The Secret Diary of a Call Girl alongside Billie Piper. Description above from the Wikipedia article Callum Blue, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1977-08-19 01:00:00.000', NULL, 'Callum Blue', '/1YtxukWwiIiDz8lgvhrDFzdSNki.jpg', 'London, UK', NULL, 68287, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(188, 'â€‹From Wikipedia, the free encyclopedia Jasmine Guy (born March 10, 1962) is an American actress, singer and dancer. She is best known for her starring role as Whitley Gilbert in the television sitcom A Different World and Roxy in Dead Like Me. Description above from the Wikipedia article Jasmine Guy, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1962-03-10 01:00:00.000', NULL, 'Jasmine Guy', '/lPS31XhPeciRouqU7qaye2suZfR.jpg', 'Boston, Massachusetts, USA', NULL, 77353, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(189, 'From Wikipedia, the free encyclopedia Cynthia Stevenson (born August 2, 1962) is an American actress. Stevenson was born in Oakland, California, the daughter of Gayle, an editor, and Al Stevenson, an upholstery warehouse owner. She grew up in Vancouver, British Columbia. One of her first roles was a guest appearance as Norm Peterson''s high-strung secretary "Doris" on Cheers. Other early work included the short-lived comedy series My Talk Show (1990â€“1991) and Bob (1992â€“1993). She had a leading role on the sitcom, Hope and Gloria, which ran for 35 episodes in 1995 and 1996. She also appeared the Lifetime Television series Oh Baby. On film, she has appeared in The Player, Six Feet Under, Forget Paris, Happiness, Home for the Holidays, Will you Merry Me?, Agent Cody Banks and Agent Cody Banks 2. She played the role of Mrs. Cooverman in the 2009 film I Love You Beth Cooper. Stevenson was a regular cast member on the series Dead Like Me, playing lead character George (Ellen Muth)''s mother. In April 2006, she completed filming a new sitcom pilot for CBS called You''ve Reached the Elliotts, starring opposite Chris Elliott as his wife, which was not picked up by the network. She has a recurring role on the cable series The L Word, and on the now-cancelled series Men in Trees, which was taped in Vancouver. She also had an occasional role as "Cindy Devlin" on According to Jim. In April 2009, she co-starred opposite Bob Saget on the short-lived ABC sitcom, Surviving Suburbia. She has also recently appeared as Shiri Appleby''s mother on The CW series Life.', '1962-08-02 01:00:00.000', NULL, 'Cynthia Stevenson', '/b59DN25UqjxOLHVBFLMtbiOwn0W.jpg', 'Piedmont - California - USA', NULL, 65528, NULL);
