INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(191, 'From Wikipedia, the free encyclopedia. Dylan Moran (born 3 November 1971) is an Irish comedian, writer, actor and filmmaker. He is most famous for his sardonic observational comedy, the television sitcom Black Books which he co-wrote and starred in and his work with Simon Pegg in Shaun of the Dead and Run Fatboy Run. Moran also appeared as one of the two lead characters in the Irish black comedy titled A Film with Me in It in 2008. He is a regular performer at national and international comedy festivals including the Edinburgh Festival Fringe, Just for Laughs Montreal Comedy Festival, the Melbourne International Comedy Festival and the Kilkenny Comedy Festival. In 2007 he was voted the 17th greatest stand-up comic on Channel 4''s 100 Greatest Stand-Ups and again in the updated 2010 list as the 14th greatest stand-up comic. Description above from the Wikipedia article Dylan Moran, licensed under CC-BY-SA, full list of contributors on Wikipedia.', '1971-11-03 01:00:00.000', NULL, 'Dylan Moran', '/fRytf4KnZQmwYgVx7HZDs1w4F5b.jpg', 'Navan, County Meath, Ireland', NULL, 7028, NULL);
INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(192, 'From Wikipedia, the free encyclopedia. Bill Bailey (born Mark Bailey 13 January 1964, Bath, Somerset) is an English stand-up comedian, musician and actor. As well as his extensive stand-up work, Bailey is well known for his appearances on Have I Got News for You, Never Mind the Buzzcocks, QI and Black Books. Bailey was listed by The Observer as one of the 50 funniest acts in British comedy in 2003. In 2007 and again in 2010, he was voted the 7th greatest stand-up comic on Channel 4''s 100 Greatest Stand-Ups. Bill Bailey is a patron of International Animal Rescue. Description above from the Wikipedia article Bill Bailey, licensed under CC-BY-SA, full list of contributors on Wikipedia', '1964-01-13 01:00:00.000', NULL, 'Bill Bailey', '/xesqtiAUbIbzTCqhsvUpf9JNUu9.jpg', 'Bath, Somerset, England, UK [now Bath and North East Somerset, England, UK]', NULL, 24265, NULL);
