INSERT INTO onlinemoviedatabase.persons (id, biography, birthday, created_date, name, picture, place_of_birth, `role`, tmdb_person_id, updated_date) VALUES(194, 'Graham LinehanÂ is anÂ Irishtelevision comedyÂ writer and director who, often in partnership withÂ Arthur Mathews, has written or co-written a number of popular television comedies. He is most noted for the sitcomsÂ Father Ted,Â Black BooksÂ andÂ The IT Crowd. Amongst others, he has also worked onÂ Big Train,Count Arthur Strong,Â Brass EyeandÂ The Fast Show.', '1968-05-22 01:00:00.000', NULL, 'Graham Linehan', '/nq7zHPWUgw3w0JKkPHQ8vNkhkua.jpg', 'Dublin, Ireland ', NULL, 98107, NULL);
