INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(1, NULL, 1, 'Air (1)', 'When Icarus Base is attacked, it''s inhabitants are forced to flee through the Stargate. The base was created on a distant planet to take advantage of a powerful energy supply located there. Their goal is to try and determine the purpose of the mysterious ninth symbol of the Stargate which they have never been able to lock in. In going through the Stargate, they are transported not to Earth but onto an very old, apparently uninhabited but huge spacecraft. With the group''s commander injured, Lt. Scott and the chief scientist, Dr. Nicholas Rush lead the exploration of the craft. Several areas of the ship have been damaged but it is basically functional. They are able to learn that they are in fact billions of light years from Earth.', '2009-10-02 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(2, NULL, 2, 'Air (2)', 'The survivors arrive on an uninhabited ship floating billions of light years away from Earth. Panic spreads throughout the group and Col. Young, who was severely injured during the escape, transfers command to Lt. Matthew Scott, before lapsing into unconsciousness. Teams led by Dr. Rush and Sgt. Greer try to make sense of the situation, while Lt. Tamara Johansen, a medic who was days away from leaving the program, is thrust into the role of chief medical officer.', '2009-10-02 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(3, NULL, 3, 'Air (3)', 'With the air supply failing on the Destiny, a team disembarks to a desert-like planet in search of the mineral needed to scrub the shipâ€™s air of carbon dioxide. After testing numerous sand samples without success, and with their window of opportunity closing fast, the group opts to split into two to cover more ground, despite the unbearable heat.', '2009-10-09 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(4, NULL, 4, 'Darkness', 'The Destiny suffers a power crisis, putting the lives of the stranded crew in jeopardy and forcing them to consider abandoning the ship.', '2009-10-16 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(5, NULL, 5, 'Light', 'With the ship on a collision course, the crew must decide who will stay and who will flee on the shuttle to try and find a habitable planet.', '2009-10-23 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(6, NULL, 6, 'Water', 'Severe rationing can''t save the Destiny''s dwindling water supply, forcing Colonel Young and Lieutenant Scott to seek out drinkable water on a deadly ice planet.', '2009-10-30 01:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(7, NULL, 7, 'Earth', 'With the situation onboard the Destiny dire, General O''Neill and Home World Command orders Col. Young to execute a high risk plan concocted by the I.O.A. scientists which, in theory, could return the crew to earth.', '2009-11-06 01:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(8, NULL, 8, 'Time', 'Visiting a newly discovered jungle planet, the crew is amazed to recover a Kino by the gate. Downloading the Kino data, Eli discovers video of the team, which appears to have been shot during an earlier visit. The mystery of the videoâ€™s origin becomes a secondary concern as members of the team start falling ill.', '2009-11-13 01:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(9, NULL, 9, 'Life', 'Aboard Destiny, Dr. Rush supervises the exploration of new areas of the ship. Looking for resources to make their everyday lives easier, the crew stumbles upon a piece of Ancient technology that carries the promise of a way home. While somewhat familiar with the find, Dr. Rush canâ€™t guarantee the safety of using it, bringing him and Col. Young to a standoff on what to do.', '2009-11-20 01:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(10, NULL, 10, 'Justice', 'Everyone is shocked when a member of the crew is found dead from a gunshot wound. While at first glance it appears to be suicide, the gun is nowhere to be found. The crew is confined to quarters while a search is performed and when the gun shows up in Col. Youngâ€™s quarters, he becomes the number one suspect.', '2009-12-04 01:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(11, NULL, 11, 'Space (1)', 'A snafu with the communications stones lands Col. Young''s consciousness in an unknown being, resulting in a standoff between the Destiny and an alien vessel and the abduction of Chloe.', '2010-04-02 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(12, NULL, 12, 'Divided (2)', 'Dr. Nicholas Rush and Chloe suffer nightmares following their ordeal on the alien vessel, and Rush suspects that a tracking device may have been placed on the ship''s hull. Later, a splinter group on Destiny executes a coup with life-threatening consequences.', '2010-04-09 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(13, NULL, 13, 'Faith', 'Now firmly in control again, Col. Young and the other military personnel try to find a way to live with the civilians who tried to take control of the ship. When the Destiny prematurely comes out of hyper-space due to a computer glitch, they find both a sun and an Earth-like planet that should not be there. Rush concludes that the entire system was created by an alien race that is far beyond their imaginations. With the ship malfunctioning and a month''s worth of repairs before it can jump again, several of the military and civilians decide to spend time on the planet. Hard feelings from the mutiny persist and it''s an opportunity for everyone to mend fences. When the time comes to return to the Destiny, several of them decide they want to stay on the planet. Young is prepared to let them stay, but he imposes severe conditions.', '2010-04-16 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(14, NULL, 14, 'Human', 'Dr. Rush relives his past life by sitting in the alien chair in an attempt to download critical data. A university professor, his wife''s cancer returns and he is recruited by Dr. Daniel Jackson for what will be called the Icarus project. He''s avoiding dealing with his wife''s situation and throws himself into his work. In his dream-like state, he''s trying to make sense of all the information he is accumulating. Back on the ship, the Destiny comes out of hyperspace and some of the crew investigate the planet below. They find an ancient archaeological site but are trapped when part of the site caves in. Digging them out is a slow process and the next jump is quickly approaching.', '2010-04-23 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(15, NULL, 15, 'Lost', 'Still trapped on the planet after the Destiny has jumped, Lt. Scott, Sgt. Greer, Chloe and Eli try to find a way out of the underground maze. After one is caught in another cave in, the remaining three make their way to a gate but must jump blindly from planet to planet hoping to pick up a signal from the Destiny before it jumps. On board the ship, Col. Young decides to send out a search party. The clock is ticking down and the next jump will take them into an inter-galactic void forever leaving their friends behind. TJ meanwhile decides the time has come to tell Col. Young that she is pregnant with his child.', '2010-04-30 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(16, NULL, 16, 'Sabotage', 'The Destiny has jumped into hyperspace and is now traveling through an inter-galactic void. They''ve also been unable to locate Eli, Chloe and Scott who have been left behind. Dr. Rush has calculated that based on their current energy consumption, the Destiny has insufficient fuel to reach the next galaxy and they are doomed to die. The engines suddenly fail however and they arrange for an expert, Amanda Perry, to come on board via the communication stones and help them out. Perry and Rush have known each other for many years but as a quadriplegic, is experiencing what life has to offer. On Earth, Camile Wray''s consciousness has been transferred to Perry''s body and is wheelchair bound.', '2010-05-07 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(17, NULL, 17, 'Pain', 'Dr. Tamara Johansen tries to track down what is causing the crew to hallucinate.', '2010-05-14 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(18, NULL, 18, 'Subversion', 'Earth''s Stargate Program isn''t the only group in the Milky Way that''s interested in the Ancients'' Destiny. What''s worse, this long-time foe may have a spy among those closest to the Icarus project.', '2010-05-21 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(19, NULL, 19, 'Incursion (1)', 'An enemy from the Milky Way has boarded the Destiny and has taken hostages. Is it possible that they know how to get back or have they stranded themselves as well?', '2010-06-04 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(20, NULL, 20, 'Incursion (2)', 'As Young and Camille attempt to resolve the hostage crisis with Kiva, Destiny suffers from power fluctuations and blackouts due to its proximity to a binary pulsar.', '2010-06-11 02:00:00.000', 1, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(21, NULL, 1, 'Intervention (3)', 'Everett and the crew continue their efforts to save Destiny while holding off the Lucian Alliance invaders.', '2010-09-28 02:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(22, NULL, 2, 'Aftermath', 'Desperate for food and water, Rush directs the ship to a planet that has been locked out of Destiny''s controls. Young and Wray clash over what to do with the Alliance prisoners.', '2010-10-05 02:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(23, NULL, 3, 'Awakenings', 'The crew encounters a ship remarkably similar to Destiny, which may hold the key to their returning home.', '2010-10-12 02:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(24, NULL, 4, 'Pathogen', 'Chloe behaves in a bizarre way, prompting a search of her quarters, where Lt. Scott finds a journal penned in an alien language. Elsewhere, Eli copes with his mother''s medical condition.', '2010-10-19 02:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(25, NULL, 5, 'Cloverdale', 'When Scott''s team explores a new planet, a plant-like organism infects the lieutenant, causing him to hallucinate a life back on Earth where he is getting married.', '2010-10-26 02:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(26, NULL, 6, 'Trial and Error', 'Young is plagued by mysterious dreams where Destiny is destroyed by alien attackers no matter what he does.', '2010-11-02 01:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(27, NULL, 7, 'The Greater Good', 'Rush and Young investigate an abandoned alien craft which is just outside the Destiny. While they do this, the crew onboard the ship find the bridge and discover that Rush is responsible for the countdown clock not activating when the ship emerges from FTL.', '2010-11-09 01:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(28, NULL, 8, 'Malice', 'Simeon makes his escape from Destiny, sending Nicholas Rush on a vengeful mission. But Young and Greer attempt to retrieve Simeon unharmed.', '2010-11-16 01:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(29, NULL, 9, 'Visitation', 'Members of the crew left behind in another galaxy make a shocking return to Destiny.', '2010-11-23 01:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(30, NULL, 10, 'Resurgence (1)', 'The crew''s new-found control over Destiny''s flight path introduces new risks when they find themselves in the middle of a war between two races.', '2010-11-30 01:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(31, NULL, 11, 'Deliverance (2)', 'Locked in a battle with a Drone Command Ship, the Destiny is surprised by the arrival of the Aliens that abducted Rush and Chloe.', '2011-03-07 01:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(32, NULL, 12, 'Twin Destinies', 'Rush travels back in time to avert a disaster, meeting a past version of himself.', '2011-03-14 01:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(33, NULL, 13, 'Alliances', 'Camille and Sgt. Greer are trapped when Homeworld Command comes under attack.', '2011-03-21 01:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(34, NULL, 14, 'Hope', 'Chloe''s body is taken over by another consciousness. Meanwhile, Dr. Volker is stricken with a mysterious illness.', '2011-03-28 02:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(35, NULL, 15, 'Seizure', 'Rush slips into a coma in the neural interface chair, and Amanda connects with him in the shipâ€™s matrix, but Ginn informs Eli of a problem with that scenario. Elsewhere, Dr. Rodney McKayâ€™s plan to dial the ninth chevron address hits a snag.', '2011-04-04 02:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(36, NULL, 16, 'The Hunt', 'An alien creature attacks an exploration team from Destiny, taking two crew members captive.', '2011-04-11 02:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(37, NULL, 17, 'Common Descent (1)', 'Destiny comes upon a colony where the people claim their civilization was founded two thousand years earlier ... by Destiny''s crew.', '2011-04-18 02:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(38, NULL, 18, 'Epilogue (2)', 'While attempting to return a group of colonists to their home, the crew finds that the planet is on the verge of seismic destruction.', '2011-04-25 02:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(39, NULL, 19, 'Blockade', 'The Destiny needs to be refueled but every time they come out of hyperspace the drones seem to be waiting for them. It''s not obvious how the drones know they''re there but it doesn''t matter a great deal since they only have one more try before running out of fuel completely. Ely suggests they go through a Blue Super Giant star, though the heat it creates might destroy the ship. They have little choice so Col. Young evacuates everyone to the only planet available with the exception of Ely and Rush. Lisa also stays behind to collect some of the medicinal herbs they''ve grown only to be trapped just as the Destiny goes through the star. On the planet, Young and the others find evidence of a destroyed civilization - and the drones.', '2011-05-02 02:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(40, NULL, 20, 'Gauntlet', 'Eli and Rush have found a way to identify the location of drone mother ships using the Destiny''s long range sensors. The bad news is that the Drones seems to be awaiting them at every possible stop along Destiny''s path. They find a temporary solution to neutralize the mother ships but realize that they cannot engage in a major battle every time they need to re-supply. Eli suggest that they use the stasis pods for the crew and jump to the next galaxy, a trip that will take three years. All goes well until they realize that one of the pods has been damaged and one person will have to stay behind in the hopes of fixing the unit in the short time available or die.', '2011-05-09 02:00:00.000', 2, NULL, 11, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(41, NULL, 1, 'Dulcinea', 'In the outer solar system near Saturn, James Holden and the crew of the ice-freighter Canterbury, investigate a distress call from a mysterious derelict ship, the Scopuli. On Ceres Station, Detective Miller begins an off the book investigation of a missing heiress, Julie Mao.', '2015-12-14 01:00:00.000', 1, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(42, NULL, 2, 'The Big Empty', 'Holden and crew are trapped in badly damaged shuttle. On Ceres, Miller uncovers clues about Julie Mao. On Earth, Chrisjen Avasarala questions a terrorist.', '2015-12-15 01:00:00.000', 1, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(43, NULL, 3, 'Remember the Cant', 'Holden and the crew are taken prisoner by the Martian Congressional Republic Navy. Miller deals with unhappy rioters. Avasarala plays politics and gets severely burned.', '2015-12-22 01:00:00.000', 1, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(44, NULL, 4, 'CQB', 'Holden and crew find themselves in the middle of a desperate battle while still aboard the Martian battleship. Millerâ€™s partner, Havelock, goes missing.', '2015-12-29 01:00:00.000', 1, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(45, NULL, 5, 'Back to the Butcher', 'Holden finds an unlikely ally. Millerâ€™s obsession with Mao intensifies.', '2016-01-05 01:00:00.000', 1, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(46, NULL, 6, 'Rock Bottom', 'Miller gains valuable information from a hidden data cube. Holden and his crew learn their hostâ€™s agenda.', '2016-01-12 01:00:00.000', 1, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(47, NULL, 7, 'Windmills', 'Holden and his crew face a Martian military blockade. Miller finds a new reason to forge ahead. Avasarala visits Holdenâ€™s family.', '2016-01-19 01:00:00.000', 1, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(48, NULL, 8, 'Salvage', 'A derelict vessel holds a potentially devastating secret. Holden and his crew cross paths with Miller on Eros. Avasarala receives bad news.', '2016-01-26 01:00:00.000', 1, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(49, NULL, 9, 'Critical Mass', 'Julie''s origin story ends up revealing her trajectory. Holden and Miller work together as they take a look at a strange emergency happening on Eros.', '2016-02-02 01:00:00.000', 1, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(50, NULL, 10, 'Leviathan Wakes', 'Avasarala uncovers a game-changing secret while the future of the human race might be in Holden and Miller''s hands.', '2016-02-02 01:00:00.000', 1, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(51, NULL, 1, 'Safe', 'Unlikely allies Joe Miller and the crew of the Rocinante led by Jim Holden uncover more about the conspiracy to release the protomolecule on Eros station.', '2017-02-01 01:00:00.000', 2, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(52, NULL, 2, 'Doors & Corners', 'With the help of Fred Johnson and the OPA, Miller, Holden and the crew stage a raid for information on the protomolecule. On Earth, Avasarala learns a truth about Fred Johnson.', '2017-02-01 01:00:00.000', 2, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(53, NULL, 3, 'Static', 'Holden and Miller butt heads about how the raid was handled.', '2017-02-08 01:00:00.000', 2, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(54, NULL, 4, 'Godspeed', 'Miller devises a dangerous plan to eradicate what''s left of the protomolecule on Eros.', '2017-02-15 01:00:00.000', 2, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(55, NULL, 5, 'Home', 'The Rocinante chases an asteroid as it hurtles towards Earth.', '2017-02-22 01:00:00.000', 2, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(56, NULL, 6, 'Paradigm Shift', 'Earth and Mars search for answers in the aftermath of the asteroid collision.', '2017-03-01 01:00:00.000', 2, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(57, NULL, 7, 'The Seventh Man', 'Preparations for the Earth/Mars peace conference tighten the tension on Erringwright.', '2017-03-08 01:00:00.000', 2, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(58, NULL, 8, 'Pyre', 'Naomi tracks down signs of the protomolecule; Fred Johnson''s control over the OPA collapses.', '2017-03-15 01:00:00.000', 2, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(59, NULL, 9, 'The Weeping Somnambulist', 'Bobbie becomes a political pawn in the struggle between Earth and Mars.', '2017-03-22 01:00:00.000', 2, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(60, NULL, 10, 'Cascade', 'Holden leads his crew through the war-torn station on Ganymede.', '2017-03-29 02:00:00.000', 2, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(61, NULL, 11, 'Here There Be Dragons', 'Bobbie makes a decision that changes her life forever.', '2017-04-05 02:00:00.000', 2, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(62, NULL, 12, 'The Monster and the Rocket', 'A discovery pushes Naomi and Holden apart and sets the Rocinante crew against each other.', '2017-04-12 02:00:00.000', 2, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(63, NULL, 13, 'Caliban''s War', 'The Rocinante crew must fight to save the ship.', '2017-04-19 02:00:00.000', 2, NULL, 12, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(64, NULL, 1, 'The Stolen Eagle', 'Eager to return to Rome after eight long years of war, Gaius Julius Caesar ends his campaign with a resounding triumph in Gaul, and news of a shattering personal loss at home. In Rome, Caesar''s old friend Pompey is counselled by the Senate, who worry about Caesar''s growing popularity. Two soldiers are enlisted to find the army''s stolen gold standard. Atia is careful to play both sides of an escalating power struggle.', '2005-08-28 02:00:00.000', 1, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(65, NULL, 2, 'How Titus Pullo Brought Down the Republic', 'Anointed People''s Tribune by Caesar, Mark Antony returns to Rome with Octavian''s liberators, Vorenus and Pullo. After being feted by a grateful Atia, Vorenus heads home to his family, for the first time in eight years, while Pullo heads for the brothels. Pompey drafts an ultimatum stripping the general of his power.', '2005-09-04 02:00:00.000', 1, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(66, NULL, 3, 'An Owl in a Thornbush', 'With Caesar quickly advancing toward Rome, Pompey begins ordering a retreat and forces his citizens to pick sides. Timon is forced to do Atia''s dirty work and Vorenus cannot understand why no one is resisting while on a scouting mission.', '2005-09-11 02:00:00.000', 1, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(67, NULL, 4, 'Stealing From Saturn', 'As Pompey "maneuvers" outside the city, Caesar seeks to consolidate his hold on Rome. Atia throws a party to welcome Caesar home, while Vorenus throws one of his own to usher in his new life as a citizen businessman. Pullo''s run of luck continues when he delivers Quintus Pompey to Caesar, who in turn returns Quintus to his father''s camp, with an offer of truce he knows Pompey will never accept.', '2005-09-18 02:00:00.000', 1, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(68, NULL, 5, 'The Ram Has Touched The Wall', 'Caesar weighs Pompey''s counteroffer against Antony''s recommendation to chase down Pompey''s vulnerable army. Vorenus is forced to reconsider his career choices after a series of business setbacks leave him with little income to support his family. A jealous Atia concocts a clever scheme to separate Caesar from Servilia. Pullo is recruited to tutor Octavian in the art of soldiering, but ends up learning a lesson or two from the boy.', '2005-09-25 02:00:00.000', 1, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(69, NULL, 6, 'Egeria', 'When Caeser finds himself outnumbered by Pompey''s legions, he asks Antony to join the fight. Marc Antony is having fun in his new political life while he ponders a counter-offer from Pompey. Atia urges Octavian to take another step toward manhood. Vorenus and Niobe try to bring passion back to their marriage.', '2005-10-02 02:00:00.000', 1, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(70, NULL, 7, 'Pharsalus', 'Pompey attacks an outnumbered Caesar. Vorenus and Pullo are stranded at sea. Atia continues to seek out Servilla''s friendship in order to ensure her protection, while Octavia and Servilla''s bond grows.', '2005-10-09 02:00:00.000', 1, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(71, NULL, 8, 'Caesarion', 'Having pursued Pompey into Egypt, Caesar arrives in Alexandria and meets the boy king Ptolemy XIII, who offers the general a surprise gift. Vorenus and Pullo play liberators again, freeing Ptolemy''s incarcerated sister, Cleopatra. Caesar seeks payment from Egypt for past debts, and ends up forging a strategic union to ensure his legacy.', '2005-10-16 02:00:00.000', 1, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(72, NULL, 9, 'Utica', 'With Scipio and Cato defeated, Caesar returns home to a hero''s welcome. Vorenus and Pullo''s showdown with local thug Erastes gets an unexpected reprieve from Caesar. Servilia''s plan to use Octavia to unearth a secret about Caesar backfires.', '2005-10-30 02:00:00.000', 1, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(73, NULL, 10, 'Triumph', 'Unanimously proclaimed Dictator by the Senate, Caesar pronounces the war over, and prepares for five days of feasting and games honoring his "triumph." No longer an enlisted soldier, Pullo eyes a pastoral future with Eirene, while Vorenus runs for municipal magistrate, with Posca''s help. Meanwhile, Octavian retrieves Octavia from her self-imposed exile. And Servilia invites a revenge-minded Quintus Pompey into her home, to Brutus'' dismay.', '2005-11-06 01:00:00.000', 1, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(74, NULL, 11, 'The Spoils', 'Vorenus sees to it that veteran soldiers receives severance on behalf of Caesar, and is then invited along with Niobe to one of Atia''s parties.', '2005-11-13 01:00:00.000', 1, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(75, NULL, 12, 'Kalends of February', 'Pullo and Vorenus are now heroes in the eyes of the Roman rank and file because of their arena feats. This causes Caesar to bestow rewards to those he might normally punish.', '2005-11-20 01:00:00.000', 1, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(76, NULL, 1, 'Passover', 'Things pick up shortly after Caesar''s murder. Octavian wants to keep his family from fleeing the city so he devises a plan. News of this makes Antony happy so he tells Brutus. Vorenus mourns Niobe''s death but casts aspersions upon his children.', '2007-01-14 01:00:00.000', 2, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(77, NULL, 2, 'Son of Hades', 'Cleopatra arrives in Rome to pay her homage to Caesar, and to seek legitimization for Caesarion. Egypt''s queen causes further complications between Anthony and Atia, who still struggles with Servilia. Timon''s brother arrives from Jerusalem. The death of Erastes throws the underworld, and Rome''s river commerce into chaos, and Pullo and Vorenus step into the gap. Octavian and Anthony begin a long and bitter rivalry with a dispute over Caesar''s will and sharing of power.', '2007-01-21 01:00:00.000', 2, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(78, NULL, 3, 'These Being the Words of Marcus Tullius Cicero', 'Brutus and Cassius struggle to raise foreign armies to oppose the Cesarean party. Mark Antony''s plans to change his post-consul proconsular governorship from Macedonia to Gaul are derailed when Cicero delivers an in-absentia message to the Senate, and throws his support behind Octavian. Vorenus struggles to contain an all-out gang war in the Aventine Collegium, of his own making,that he blames on Pullo. In the house of the Julii, Octavia passes the hours in a drug induced daze, while a duplicitous youth named Duro, planted amongst the Julii by Servilia, looks for the chance to set a deadly plan in motion.', '2007-01-28 01:00:00.000', 2, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(79, NULL, 4, 'Testudo et Lepus', 'Pullo races to find Vorenus with news of his family''s fate. Servilia''s plans to eliminate a rival exact a high price from her. Cicero is astonished when Octavian sends word that his victorious legions are coming home to Rome. In Rome, Timon finally grows weary of Atia''s bidding.', '2007-02-04 01:00:00.000', 2, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(80, NULL, 5, 'Heroes of the Republic', 'Despite Pullo''s advice, Vorenus and his family return to the Collegium with his family who is reunited, and cleansed of their ordeal. Octavian is denied a triumph and urges Cicero to endorse his bid to be made Consul in exchange for an agreement to allow Cicero to veto his actions. Octavian takes both Cicero and the Senate by surprise with his first Consular act. Vorenus attempts'' to make peace with Memmio and Cotta create suspicions that he has gone soft.', '2007-02-11 01:00:00.000', 2, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(81, NULL, 6, 'Philippi', 'Vorenus receives orders to plunge Rome into a bloodbath the likes that have not been seen since the dictatorship of Sulla. Octavia reveals her secret to Atia, and the armies of the Liberators and the Caesarians clash for the last time, with the fate of Republic in the balance.', '2007-02-18 01:00:00.000', 2, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(82, NULL, 7, 'Death Mask', 'Antony''s nature reasserts itself, and challenges his alliance with Octavian. Timon and Levi set themselves against Herod''s plans. Servilia''s public displays of grief leave Atia unsettled. Gaia uses Pullo''s punishment as a weapon against him. His daughter''s sudden interest in business matters arouses Vorenus'' suspicions. Posca gets married.', '2007-03-04 01:00:00.000', 2, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(83, NULL, 8, 'A Necessary Fiction', 'Octavian proclaims a new era of virtue in Rome, a program that his family and subordinates find impossible to obey. Vorenus is sent on a mission after a missing shipment of gold to discover who mysteriously hijacked it on its way to the Roman treasury. Pullo''s loss and rage are channeled against Memmio, Omnipor and their henchmen. Octavian pursues Livia as an "appropriate" bride, and issues Mark Antony an ultimatum he knows he can''t refuse.', '2007-03-11 01:00:00.000', 2, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(84, NULL, 9, 'Deus Impeditio Esuritori Nullus (No God Can Stop a Hungry Man)', 'The people of Rome are starving. There have been many grain shortages over the past few months, but things have gotten particularly bad. In hopes of keeping the people from openly rebelling, Octavian sends Atia and Octavia to Alexandria in order to negotiate a deal with Mark Antony, though his real reasons for their trip is soon revealed. Meanwhile, Titus Pullo and Lucius Vorenus must try to keep the peace amongst many of the mercenaries who are in Rome.', '2007-03-18 01:00:00.000', 2, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(85, NULL, 10, 'De Patre Vostro (About Your Father)', 'Following his naval defeat at Actium, Marc Antony returns to Egypt, where he and Cleopatra settle into a world of debauchery. Octavian tries to use Pullo as leverage to Vorenus to gain acess to the palace, but Vorenus stays loyal to Antony. Finally, it is Cleopatra who dupes Antony, saving her own life by sacrificing her honor. Ceasar Augustus triumphs in Rome.', '2007-03-25 01:00:00.000', 2, NULL, 13, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(86, NULL, 1, 'Pilot', 'When smart, cynical 18-year-old George is killed by an errant toilet seat falling from space, she joins the ranks of an undead group of grim reapers. As she clumsily learns to adjust to her new role in the afterlife, George haphazardly hurtles towards her first dreaded assignment: to collect the soul of a little girl.', '2003-06-27 02:00:00.000', 1, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(87, NULL, 2, 'Dead Girl Walking', 'George tries to shirk her new grim reaper responsibilities, but discovers that doing so leads to nasty consequences for the souls. She also attempts to get a real job by once again gracing the doorway of the Happy Time Temp Agency.', '2003-07-04 02:00:00.000', 1, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(88, NULL, 3, 'Curious George', 'George discovers the price that the dead pay when they try to hang on to their past.', '2003-07-11 02:00:00.000', 1, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(89, NULL, 4, 'Reapercussions', 'George finds a loophole in the "reaper rules" and decides to spare her next soul, but quickly learns that if you flip off Fate, Fate flings it back at you ten-fold.', '2003-07-18 02:00:00.000', 1, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(90, NULL, 5, 'Reaping Havoc', 'George realizes that even the undead need friends, but she loses one when a reaper decides to jump to the other side.', '2003-07-25 02:00:00.000', 1, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(91, NULL, 6, 'My Room', 'George meets her new roommate, Daisy Adair, a glamorous, but annoying 1930s ingenue-turned-reaper who has joined their group.', '2003-08-01 02:00:00.000', 1, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(92, NULL, 7, 'Reaper Madness', 'George gets her first post-mortem kiss from a doomed schizophrenic who can see the gravelings.', '2003-08-08 02:00:00.000', 1, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(93, NULL, 8, 'A Cook', 'George gets a pet and Rube takes a shift on the grill at Der Waffle Haus.', '2003-08-15 02:00:00.000', 1, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(94, NULL, 9, 'Sunday Mornings', 'George makes a new friend and discovers her dad is not the person she thought he was, while Roxy''s actions cause an obnoxious lout to find religion.', '2003-08-22 02:00:00.000', 1, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(95, NULL, 10, 'Business Unfinished', 'Daisy enlists George''s help in fleecing a wealthy society matron''s son, and Roxy faces her annual struggle to come to terms with her death.', '2003-08-29 02:00:00.000', 1, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(96, NULL, 11, 'The Bicycle Thief', 'Needing money to buy a bicycle, George gets a new job -- and an awkward farewell party at Happy Time - while her fellow reapers face their own complications.', '2003-09-05 02:00:00.000', 1, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(97, NULL, 12, 'Nighthawks', 'George panics when Rube is assigned to pop a soul at her family''s home.', '2003-09-12 02:00:00.000', 1, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(98, NULL, 13, 'Vacation', 'Death takes a holiday and the reapers use the break to catch up on some paperwork.', '2003-09-19 02:00:00.000', 1, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(99, NULL, 14, 'Rest in Peace', 'While George tries to get her old job back, her family prepares to visit her grave.', '2003-09-26 02:00:00.000', 1, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(100, NULL, 1, 'Send in the Clown', 'At her day job, George gets to train the boss''s cute, but dumb, nephew, while Mason dresses as a clown to reap a soul at a kid''s birthday party.', '2004-07-25 02:00:00.000', 2, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(101, NULL, 2, 'The Ledger', 'George figures that with all the bad luck she had while she was alive, things might even out in the afterlife. But death isn''t like that.', '2004-08-01 02:00:00.000', 2, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(102, NULL, 3, 'Ghost Story', 'In an attempt to bond with her co-workers, George goes on the annual Happy Time retreat, but she can''t escape her duties as a grim reaper.', '2004-08-08 02:00:00.000', 2, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(103, NULL, 4, 'The Shallow End', 'George reflects back on her childhood and decides that the secret to popularity is being mean to people.', '2004-08-15 02:00:00.000', 2, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(104, NULL, 5, 'Hurry', 'Deadlines loom large as the reapers snatch some hurried souls and George helps Delores impress an efficiency expert studying Happy Time''s operations.', '2004-08-22 02:00:00.000', 2, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(105, NULL, 6, 'In Escrow', 'George faces her first big decision at Happy Time, and Joy looks forward to a new life after accepting an offer on the family home.', '2004-08-29 02:00:00.000', 2, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(106, NULL, 7, 'Rites of Passage', 'George experiences the power of celebrity death when she plucks the soul of a rock star.', '2004-09-05 02:00:00.000', 2, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(107, NULL, 8, 'The Escape Artist', 'George nearly falls for someone she is supposed to reap, while Reggie makes friends with a young pet reaper.', '2004-09-12 02:00:00.000', 2, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(108, NULL, 9, 'Be Still My Heart', 'George reunites with her new love at his father''s funeral.', '2004-09-19 02:00:00.000', 2, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(109, NULL, 10, 'Death Defying', 'After losing her virginity to Trip, George sours on love when he doesn''t call.', '2004-09-26 02:00:00.000', 2, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(110, NULL, 11, 'Ashes to Ashes', 'When George tries to pass herself off as the relative of a homeless man, she finds herself more involved in his death than she planned.', '2004-10-03 02:00:00.000', 2, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(111, NULL, 12, 'Forget Me Not', 'Ray and Mason fight for Daisy''s affection, and George must persuade an old lady that she has really died.', '2004-10-10 02:00:00.000', 2, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(112, NULL, 13, 'Last Call', 'George regrets the things she didn''t accomplish in her life, while Mason prepares to move on in the afterlife. Meanwhile, Reggie stays home alone.', '2004-10-17 02:00:00.000', 2, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(113, NULL, 14, 'Always', 'George and Rube both find themselves coming face to face with their past lives.', '2004-10-24 02:00:00.000', 2, NULL, 14, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(114, NULL, 15, 'Haunted', 'Halloween is a busy day for the Reapers as a serial killer stalks the city.', '2004-10-31 02:00:00.000', 2, NULL, 14, NULL);
