INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(117, NULL, 2, 'Manny''s First Day', 'After Mannyâ€™s help with the tax return Bernard is persuaded to hire him in the shop. Unfortunately he actually sells some books, much to Bernardâ€™s annoyance.', '2000-10-06 02:00:00.000', 1, NULL, 15, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(118, NULL, 3, 'The Grapes of Wrath', 'Bernard and Manny accept a house-sitting job to get away from their new cleaner. They also drink some wine.', '2000-10-13 02:00:00.000', 1, NULL, 15, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(119, NULL, 4, 'The Blackout', 'A hyper, coffee fueled Manny is mistaken for a policeman.', '2000-10-20 02:00:00.000', 1, NULL, 15, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(120, NULL, 5, 'The Big Lock-Out', 'The shop gets a new security system that no-one can work.', '2000-10-27 02:00:00.000', 1, NULL, 15, NULL);
