INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(123, NULL, 1, 'The Entertainer', 'Fran decides to take up piano lessons with a very prominent teacher, however all doesn''t go to plan and she ends up having to ask Manni for a favour. Meanwhile Bernard asks a girl out and once again Manni is called upon for a favour.', '2002-03-01 01:00:00.000', 2, NULL, 15, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(124, NULL, 2, 'Fever', 'On a scorching hot day, Manni tries to maintain his body temperature so it doesn''t go over 88 degrees; Fran has problems with a new neighbour, and Bernard tries to find an appropriate "summer girl".', '2002-03-08 01:00:00.000', 2, NULL, 15, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(125, NULL, 3, 'The Fixer', 'Bernard and Manni have to deal with a gangster turned writer who plans to hold a reading of his autobiography at the book shop, however he can''t read. Meanwhile Fran gets an office job where she isn''t quite sure what she is meant to be doing.', '2002-03-15 01:00:00.000', 2, NULL, 15, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(126, NULL, 4, 'Blood', 'Manni and Bernard try to keep up with modern book shops and in doing so Manni helps Fran get over her boredom by encouraging her to look up her family tree.', '2002-03-22 01:00:00.000', 2, NULL, 15, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(127, NULL, 5, 'Hello Sun', 'Fran tries to cleanse her lifestyle by taking up yoga and going on a radical diet, while Bernard and Manni receive some books on Freud and their lives descend into his famous theories.', '2002-03-29 01:00:00.000', 2, NULL, 15, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(128, NULL, 6, 'A Nice Change', 'When construction starts next door to the shop, Manni, Bernard and Fran try to decide what to do while it continues.', '2002-04-05 02:00:00.000', 2, NULL, 15, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(129, NULL, 1, 'Manny Come Home', 'When Manny defects to Goliath Books after an "incident" with Bernard, his ex-employer''s life spirals out of control. Meanwhile Fran returns from holiday only to be greeted by the squalor of Bernard''s shop.', '2004-03-11 01:00:00.000', 3, NULL, 15, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(130, NULL, 2, 'Elephants and Hens', 'When Bernard holds a children''s themed book day in the shop, Fran bets Manni and Bernard they couldn''t write a children''s book over a weekend, while Bernard bets Fran back that she will have an awful time at her friend''s hen party.', '2004-03-18 01:00:00.000', 3, NULL, 15, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(131, NULL, 3, 'Moo-Ma and Moo-Pa', 'Manny''s parents visit the shop for the weekend, and the lies he''s told them throw Fran and Bernard''s lives into chaos.', '2004-03-25 01:00:00.000', 3, NULL, 15, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(132, NULL, 4, 'A Little Flutter', 'Bernard becomes addicted to gambling and forces Manny and Fran to compete for one job at the shop in order to finance his bets.', '2004-04-01 02:00:00.000', 3, NULL, 15, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(133, NULL, 5, 'Travel Writer', 'Fran & Manny become enamored with a dashing travel writer giving a talk at the shop, while Bernard contends with a most unorthodox new landlord.', '2004-04-08 02:00:00.000', 3, NULL, 15, NULL);
INSERT INTO onlinemoviedatabase.tv_show_episodes (id, created_date, episode, name, overview, released_date, season, still, tv_show_id, updated_date) VALUES(134, NULL, 6, 'Party', 'Manny and Fran drag Bernard along with them to a party, but the drunken aftermath dredges up secrets and bitterness.', '2004-04-15 02:00:00.000', 3, NULL, 15, NULL);
